            new(HoroscopeName.House1LordInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @" There will be more of gains teased or worried by enemies good character respectable and generous hearted. Well-disposed. He will gladly discharge his duties towards his kith and kin and will be ambitious. He will possess prominent eyes and be blessed with forethought. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House1LordInHouse2)),
