            new(HoroscopeName.House1LordInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @" There will be happiness from parents many brothers materialistic well built fair looking and well-behaved. If the 4th lord is favourably disposed the person will acquire considerable landed properties specially through maternal sources. He will be rich happy famous and commands a number of conveyances. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House1LordInHouse4)),
            new(HoroscopeName.House1LordInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @" The first child does not survive not much happiness from children short tempered subservient and serving others. If fortified  In the good graces of rulers or powerful political parties and likely to be absorbed into trade or diplomatic services. He will propitiate deities consistent with the indications of the fifth lord. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House1LordInHouse5)),
            new(HoroscopeName.House1LordInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @" In addition to the results produced by the lord of Lagna being in the third the following may also be noted. There will be bebts but they will be liquidated when the Dasa of the Lagndhipati comes. When the lord is fortified the native joins the army becomes a Commander or even a Commander-in-chief provided the lords Dasa operates at the opportune period. Or he may become head of medical or health services or an expert physician or surgeon. Here the other influences should be suitably balanced. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House1LordInHouse6)),
            new(HoroscopeName.House1LordInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @" The wife does not live or there will be more than one marriage. Later in life becomes detached from worldly affairs and tries to lead an ascetic life. Depending upon other factors the subject will either be rich or poor. There will be much travelling. If well disposed he will spend most of his time in foriegn countries and lead a licentious life. Or he will be a puppet in the hands of his parents-in-law. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House1LordInHouse7)),
            new(HoroscopeName.House1LordInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @" Learned gambling tendencies interested in occultism and mean character. If the lord is strong the native takes pride in helping others has a number of friends religiously inclined and will have a peaceful and sudden end. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House1LordInHouse8)),
            new(HoroscopeName.House1LordInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @" Generally fortunate protector of others religious is a Hinduworshipper of Vishnu good orator happiness on account of wife and children and rich. Provided the lord is well disposed he will inherit good ancestral and paternal property. The father will be famous philanthropic and god-fearing. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House1LordInHouse9)),
            new(HoroscopeName.House1LordInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @"In addition to the results of the 4th house there will be professional success honoured by eminent men a research scholar or specialisation in that branch of knowledge or profession which is represented by lord of Lagna and the 10th.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House1LordInHouse10)),
            new(HoroscopeName.House1LordInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @" In addition to the results of the 2nd house there will always be gains in business if a businessman. The subject will not experience financial straits. He owes his prosperity to his elder brother. He will earn enormous business profits consistent with the indications of the other planets joining the combination. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House1LordInHouse11)),
            new(HoroscopeName.House1LordInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @" The same results as in the 8th are produced. In addition there will be many losses visiting holy places and no success in business enterprises. He will spend inherited riches on charities and other deserving causes. Emotionally balanced he will dedicate himself for public weal. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House1LordInHouse12)),
            new(HoroscopeName.House2LordInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @" The native becomes no doubt wealthy but he hates his own family lacks polite manners becomes passionate subservient and time-serving. one will earn money by his own effort intelligence and learning ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse1)),
