            new(HoroscopeName.House2LordInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @" Becomes proud. The native may marry twice or thrice depending upon the strength of the seventh house. He may become childless. The position of the 2nd lord in a constellation which does not happen to be the 3rd 5th and 7th from Janma Nakshatra is highly desirable especially if he is otherwise fortified i.e. joined with or aspected by benefics. The exaltation of the 2nd lord of his disposition in Lagna the 4th 5th 7th 9th or 10th will fortify him to the extent of making him a yogakaraka. The native will be enabled to earn considerable fortune through business or other occupations consistent with the nature of the 2nd lord and 2nd house. Depending upon the nature of the aspects cast on the 2nd lord by malefic planets the native will sustain losses. An affliction to the 2nd lord may also express itself in the shape of the subject not getting nutritious and delicious food or his family and children suffering from constant diseases or want of cordial relations between the native and his life-partner. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse2)),
            new(HoroscopeName.House2LordInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @" Brave intelligent good-natured but depraved character. Atheistic tendencies will be rampant and he becomes addicted to luxuries. Later in life he turns out to be a miser. When the 2nd lord in the 3rd is well fortified he will be benefited by his sisters. He will benefit by learning fine arts viz. music and dancing. He will also indulge in propitiating Kshudra Devatas or evil spirits. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse3)),
            new(HoroscopeName.House2LordInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @" The above results will apply in addition to the following. He will spend money for his own happiness. He will be highly frugal in dealing with money. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse4)),
            new(HoroscopeName.House2LordInHouse4Fortified, EventNature.Good, SpecializedSummary.Empty, @" one will earn well as an automobile dealer or agent or an agriculturist or landlord or commission agent. He will also be benefited by his maternal relations. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse4Fortified)),
