            new(HoroscopeName.House2LordInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @"Hating family sensual not spending money even on children he lacks manners and etiquette. When the 2nd lord in the 5th is well fortified there will be unexpected acquisition of wealth through lotteries crosswords or the favour of rulers.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse5)),
            new(HoroscopeName.House2LordInHouse6Afflicted, EventNature.Neutral, SpecializedSummary.Empty, @" Income and expenditure from enemies. He will suffer from defects or diseases in the anus and thighs. black-marketing deceit dissimulation and by creating misunderstandings and troubles between friends and relatives and through questionable and suspicious dealings can be anticipated He will be involved in these troubles and sentenced for such crimes as breach of trust forgeries and perjuries. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse6Afflicted)),
            new(HoroscopeName.House2LordInHouse6Fortified, EventNature.Neutral, SpecializedSummary.Empty, @" Income and expenditure from enemies. He will suffer from defects or diseases in the anus and thighs. Amassing of wealth by black-marketing deceit dissimulation and by creating misunderstandings and troubles between friends and relatives and through questionable and suspicious dealings can be anticipated ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse6Fortified)),
            new(HoroscopeName.House2LordInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @" Likely to become a healer. Laxity of morals will mark both husband and wife. He will waste much money on the gratification of the senses. When the second lord who joins the 7th with the 7th lord is strong there will be influx of wealth through foreign sources. The native will undertake journeys to foreign countries and do business. When the Rasi Navamsa or the constellation held by the 2nd lord happens to be a feminine one then he will benefit by contact with women. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse7)),
            new(HoroscopeName.House2LordInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @" Will have very little or no happiness from wife or husband. Misunderstandings with elder brothers. Gets landed properties. When the 2nd lord is strong there will be influx as well as loss of wealth. Actual observation reveals that under such a combination there will hardly be any earnings but inherited or accumulated wealth will disappear. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse8)),
            new(HoroscopeName.House2LordInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @"Skilful ill-health in young age but healthy afterwards will possess lot of wealth and become happy. When the 2nd lord is well fortified and the 9th lord is in Lagna the native will have good inheritance. There will also be benefits through different sources according to the nature of the sign and nakshatra held by the 2nd lord.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse9)),
