            new(HoroscopeName.House2LordInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @" Health will be bad during childhood earns considerable wealth but becomes unscrupulous. When well fortified one earns by lending money or as a banker or by running a boarding house. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse11)),
            new(HoroscopeName.House2LordInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @" The native becomes a respectable man. In all probability he will be a government servant and will be deprived of the happiness of elder brother. The income will be through ecclesiastical sources. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse12)),
            new(HoroscopeName.House2LordInHouse12Afflicted, EventNature.Neutral, SpecializedSummary.Empty, @" The native becomes a respectable man. In all probability he will be a government servant and will be deprived of the happiness of elder brother. He will lose money through ecclesiastical sources. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House2LordInHouse12Afflicted)),
            new(HoroscopeName.House3LordInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @" Earns livelihood by self-exertion becomes vindictive lean and tall body brave and courageous always sickly and serving others. When well fortified he will become an expert in dancing music and acting and the means of livelihood will be primarily fine arts. He will earn a good name as an actor. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse1)),
