            new(HoroscopeName.House3LordInHouse4WeakMars, EventNature.Bad, SpecializedSummary.Empty, @" he will lose his lands and he will have to live in others houses. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse4WeakMars)),
            new(HoroscopeName.House3LordInHouse4Fortified, EventNature.Neutral, SpecializedSummary.Empty, @" his brothers will survive him. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse4Fortified)),
            new(HoroscopeName.House3LordInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @" Much pleasure will not be derived from children. Financially well off in life. Friction will prevail in the domestic life. well disposed the native will be highly benefited by his brothers. He will carry on agricultural operations on a large scale or he will be adopted by a rich family. He will also shine well in Government service. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse5)),
            new(HoroscopeName.House3LordInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @" Hates brothers and relatives and difficulty through them. Becomes rich. Maternal relatives will suffer. Accepts illegal gratifications. When the 3rd lord is in the 6th well disposed younger brother joins the Army. One of the brothers will become a successful physician. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse6)),
            new(HoroscopeName.House3LordInHouse6Lord3rd, EventNature.Neutral, SpecializedSummary.Empty, @" the native becomes either a sportsman physical culturist or an athlete. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse6Lord3rd)),
            new(HoroscopeName.House3LordInHouse6Lord3rdAfflicted, EventNature.Neutral, SpecializedSummary.Empty, @" he will suffer from diseases and be tormented by enemies and he will himself be deceitful. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse6Lord3rdAfflicted)),
            new(HoroscopeName.House3LordInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @"May incur the displeasure of rulers or authorities. Many vicissitudes in life. Much suffering in childhood. The union will be unfortunate. Danger while travelling. When the 3rd lord is in the 7th well fortified there will be cordial feelings between brothers. When the 7th lord is in Lagna one of the brothers will settle in a foreign country and he will help the native.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse7)),
            new(HoroscopeName.House3LordInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @"Involvement in a criminal case or false accusations. Trouble on account of death or bequests marriage unfortunate career will not be smooth victim of misfortune. When the 3rd lord is in the 8th he will suffer from a serious and dangerous disease and lose his younger brother.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse8)),
            new(HoroscopeName.House3LordInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @"Fortune will improve after marriage. Father untrustworthy. Long journeys. Sudden and unexpected changes in life. When the 3rd lord is in the 9th favourably disposed the natives brother will inherit ancestral property. The native himself will be benefited by his brother. When afflicted the person will have misunderstandings with his father.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse9)),
            new(HoroscopeName.House3LordInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @"A quarrelsome and faithless wife. The native will become rich. He will be happy and intelligent. Gain from journeys connected with profession. When the 3rd lord is in the 10th all the brother will shine well and they will be helpful to him in all ways", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse10)),
            new(HoroscopeName.House3LordInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @"Not a very good combination.. Earnings with effort. He becomes vindictive. The body will be unattractive and emaciated. Subservient to or dependent upon others and liable to surfer from frequent attacks of illness.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse11)),
            new(HoroscopeName.House3LordInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @"Sorrow through relatives gets fortune from marriage seclusion. Great ups and downs. Unscrupulous father. When the 3rd lord is in the 12th the youngest brother will be a tyrant. The native becomes poor on account of him.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House3LordInHouse12)),
            new(HoroscopeName.House4LordInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"The person becomes highly learned but will be afraid to speak in public assemblies. He is likely to lose inherited wealth. According as the fourth lord posited in Lagna is strong middling or weak the native will have been born in a rich mediocre or poor family.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse1)),
            new(HoroscopeName.House4LordInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"He will be highly fortunate courageous and happy. He will have a sarcastic nature. He will inherit property from maternal grandfather.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse2)),
            new(HoroscopeName.House4LordInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"The person will be sickly generous a man of character and will acquire wealth by self-effort. He will suffer from the machinations of step-brothers and step-mother.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse3)),
            new(HoroscopeName.House4LordInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @"Religiously inclined will have respect for traditions. He will be rich respected happy and sensual.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse4)),
            new(HoroscopeName.House4LordInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @"Loved and respected by others devotee of Vishnu becomes rich by self-effort. Mother comes from a respectable family. The native will acquire vehicles.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse5)),
            new(HoroscopeName.House4LordInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @"Short-tempered and mean he will have dissimulating habits evil thoughts and intentions. He will always be roaming about.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse6)),
            new(HoroscopeName.House4LordInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @"Generally happy  will command houses and lands  will eke out livelihood in distant places or near his birthplace according as the seventh happens to be a movable or fixed sign.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse7)),
            new(HoroscopeName.House4LordInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @"The person becomes miserable. Father dies early. He will be either impotent or loose in sex-life. He is also likely to lose landed properties or face litigation.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse8)),
            new(HoroscopeName.House4LordInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @"Generally a fortunate combination favouring happiness in regard to father and properties.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse9)),
            new(HoroscopeName.House4LordInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @" Will have political success. He will be an expert chemist. He will vanquish his enemies and make his personality felt by the world. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse10)),
            new(HoroscopeName.House4LordInHouse10Afflicted, EventNature.Neutral, SpecializedSummary.Empty, @" Loss of reputation is possible ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse10Afflicted)),
            new(HoroscopeName.House4LordInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @"Self-made generous sickly mother fortunate but may have a step-mother also. Favours success in selling and buying cattle and lands.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse11)),
            new(HoroscopeName.House4LordInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @"Deprived of happiness and properties. Early death to mother bad finances and generally a miserable existence.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House4LordInHouse12)),
            new(HoroscopeName.House5LordInHouse1Fortified, EventNature.Neutral, SpecializedSummary.Empty, @" the person commands a number of servants becomes a Judge Magistrate or Minister empowered to punish the evil-minded. He will earn the grace of God  few children  will have foes and gives happiness to others. If the 5th lord is afflicted there will be no issues will invoke kshudra devatas evil and destructive forces will be evil-minded and leader of a gang of deceitful persons  a tale-bearer with a sting. If the lord is moderately good mixed results will follow. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse1Fortified)),
            new(HoroscopeName.House5LordInHouse1Afflicted, EventNature.Neutral, SpecializedSummary.Empty, @" there will be no issues will invoke kshudra devatas evil and destructive forces will be evil-minded and leader of a gang of deceitful persons  a tale-bearer with a sting. If the lord is moderately good mixed results will follow. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse1Afflicted)),
            new(HoroscopeName.House5LordInHouse1AfflictedModerate, EventNature.Neutral, SpecializedSummary.Empty, @" mixed results will follow. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse1AfflictedModerate)),
            new(HoroscopeName.House5LordInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"If the 5th lord is favourably disposed the person will be blessed with a beautiful wife and well-behaving children. There will be gains from Government or King. He will become learned and a good astrologer. Lord weak and afflicted Poor  loss of money through Government displeasure  will be unable to maintain his own family  will have family troubles and misunderstandings  becomes a priest in a Siva temple.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse2)),
            new(HoroscopeName.House5LordInHouse3Fortified, EventNature.Neutral, SpecializedSummary.Empty, @" many good children and brothers", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse3Fortified)),
            new(HoroscopeName.House5LordInHouse3Afflicted, EventNature.Neutral, SpecializedSummary.Empty, @" loss of children misunderstandings with brothers and continuous occupational troubles. He will become stingy and a tale bearer. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse3Afflicted)),
            new(HoroscopeName.House5LordInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @"If favourably disposed the person will have a few sons one of whom will live by agriculture. The mother will live long. May become an adviser to a ruler or his preceptor. The lord afflicted causes death of children. The lord moderately strong confers daughters and no sons.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse4)),
            new(HoroscopeName.House5LordInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @"Lord favourably disposed indicates a number of sons  becomes great in his own line of activity  otherwise he becomes an expert in Mantrasastra and befriends persons in power. He may also become an expert in mathematics or head of a religious institution. Lord afflicted contrary results should be anticipated. Children will die he will not keep to his word wavering mentality and cruel.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse5)),
            new(HoroscopeName.House5LordInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @" If the fifth lord is favourably disposed the maternal uncle will be a famous man. He will have enmity with his own son. If the lord is afflicted issues will not be born and he may have to adopt one from maternal uncles line. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse6)),
            new(HoroscopeName.House5LordInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @"When the lord is favourably disposed the natives son lives abroad and attains distinction wealth and fame. Or he will have a number of issues. He will also become renowned learned prosperous greatly devoted to his master and possesses a charming personality. When-the lord is afflicted there will be loss of children one of whom will die abroad after attaining name and fame.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse7)),
            new(HoroscopeName.House5LordInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @"Paternal property will be lost due to debts. There will be extinction of the family. He will suffer from lung troubles. He will be peevish unhappy but not poor.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse8)),
            new(HoroscopeName.House5LordInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @" He will become a teacher or a preceptor. Renovates ancient temples wells choultries and gardens. One of the sons attains distinction as an orator or author. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse9)),
            new(HoroscopeName.House5LordInHouse9Afflicted, EventNature.Neutral, SpecializedSummary.Empty, @" he will earn divine wrath and consequent destruction of fortune. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse9Afflicted)),
            new(HoroscopeName.House5LordInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @"If the lord is beneficially disposed a Raja Yoga is formed. Acquires landed property  earns the goodwill of the rulers constructs temples and performs religious sacrifices  one of the sons becomes a gem of the family. If aspected by the Sun the native may join the intelligence department. If the lord is afflicted faces the wrath of the rulers and contrary results will happen.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse10)),
            new(HoroscopeName.House5LordInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @"Benefits through sons and success in all undertakings becomes rich and learned and helps others will have a number of sons becomes an author.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse11)),
            new(HoroscopeName.House5LordInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @"Quest for knowing the Ultimate Reality will be pronounced. He will lead a life of non-attachment becomes spiritual moves from one place to another and ultimately attains Moksha.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House5LordInHouse12)),
            new(HoroscopeName.House6LordInHouse1Fortified, EventNature.Neutral, SpecializedSummary.Empty, @" the person may Join the army as a soldier or Commander consistent with the strength or otherwise of the disposition. Or he may become a Minister of War or an official or officer concerned with prisons. He will live in the house of his maternal uncle. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse1Fortified)),
            new(HoroscopeName.House6LordInHouse1Afflicted, EventNature.Neutral, SpecializedSummary.Empty, @" he will become a robber or a thief or leader of a criminal gang. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse1Afflicted)),
            new(HoroscopeName.House6LordInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @" Conjoined with or aspected by benefics the native will have untold suffering in family life and deep sorrows loss of money through enemies defective vision uneven teeth and stammering. If the sixth lord is weak and otherwise ill-disposed in the 2nd there will be loss of wife in the Dasa or Bhukti of the malefic lord. If Venus is weak the native will be a celibate and poverty-stricken just able to get a morsel of food when hungry. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse2)),
            new(HoroscopeName.House6LordInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"The sixth lord fortified confers enmity with brothers. Or his maternal uncle befriending the natives brother works against the natives interests or the natives brother suffers from frequent ill-health. The 6th lord weak and afflicted the native will have no younger brothers.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse3)),
            new(HoroscopeName.House6LordInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @"Well fortified lives in a dilapidated building. He will have breaks in education and will discard his mother. Maternal uncles will generally be land cultivators. Weak and afflicted he will quarrel with his mother and ancestral property will be involved in debts. He will work as a menial and lead a miserable life. Troublesome home and domestic affairs and trouble through servants.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse4)),
            new(HoroscopeName.House6LordInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @"Sickly children. The native will be adopted by his maternal uncle and become fortunate.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse5)),
            new(HoroscopeName.House6LordInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @"Increase of cousins. Natives maternal uncle becomes famed. If in conjunction with weak Lagnadhipathi he will suffer from an incurable disease and increase of enmity with kith and kin.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse6)),
            new(HoroscopeName.House6LordInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @"Generally marries mothers brothers or fathers sisters daughter. The maternal uncle lives in a far-off place or a foreign country. The wifes character will be doubtful. If the sixth lord is afflicted he will either divorce his wife early in life or she will die. If the Rasi and Navamsa involved are hermaphrodite ones he will have a sickly or barren wife. When Lagnadhipati joins the sixth lord in the 7th which happens to be a hermaphrodite sign the native will be a eunuch and unable to perform the sexual act. There will also be troubles with disrespectable women.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse7)),
            new(HoroscopeName.House6LordInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @"When fortified he will have Madhyayu or middle life. When afflicted he will have plenty of debts and will suffer from loathsome diseases. He will hunt after women other than his own wife and take pleasure in inflicting pain on others.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse8)),
            new(HoroscopeName.House6LordInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @"Father becomes a judge if the sixth lord is well fortified. The maternal uncle becomes highly fortunate. There will be misunderstandings between him and his father. There will be benefits from Gnatis or cousins. If afflicted  poverty sinful acts misfortunes through relatives ungrateful towards preceptors and engaged in unrighteous deeds. If moderate  becomes a mason timber merchant or stone cutter.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse9)),
            new(HoroscopeName.House6LordInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @"If fortified  Sinful and destructive nature poses as an orthodox and pious man but really unscrupulous in regard to religious matters. When the lord is weak  dismissal formidable enemies low life or begging.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse10)),
            new(HoroscopeName.House6LordInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @"If benefic eldest brother will be a judge. If ordinary  an elder brother becomes a judge for some time but loses his job. If malefic  poor and wretched life  suffering on account of convictions.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse11)),
            new(HoroscopeName.House6LordInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @"Well disposed  difficulty and sorrow through destructive nature causes harm to others. If afflicted  miserable hard and wretched existence.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House6LordInHouse12)),
            new(HoroscopeName.House7LordInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"The native may marry someone he has known since childhood or one who has been brought up in the same house. The wife or husband of the native will be a stable and mature person. He will be intelligent and capable of weighing the pros and cons. Afflictions to the 7th lord may entail constant travelling. If the 7th lord and Venus are afflicted the native may be sensual and seek clandestine relationship with the opposite sex.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House7LordInHouse1)),
            new(HoroscopeName.House7LordInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"The native will get wealth from women or through marriage. If afflicted one may earn money through despicable means as trading in flesh women not excluding his wife. He may eat food offered at death-ceremonies shraddha and wander about seeking such food. If the second house is a dual sign and afflicted more than one marriage is likely. If a maraka Dasa is on the native may die during the period of the seventh lord. The person will have a wavering mind and will always be inclined sensually.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House7LordInHouse2)),
            new(HoroscopeName.House7LordInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"This disposition gives lucky brothers who may live abroad. If afflicted the native may indulge in adultery with a brothers or sisters married partner. Affliction also gives misfortunes to co-boms. Female issues servive.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House7LordInHouse3)),
            new(HoroscopeName.House7LordInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @"Gives a lucky and happy married partner with many children and comforts. The native may have the benefit of high academic qualification and own many vehicles. If afflicted domestic harmony may be spoilt through an immature and mean partner. The native may run into endless problems on account of his conveyances. If severely afflicted by the nodes and other malefics the natives wifes character becomes questionable.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House7LordInHouse4)),
            new(HoroscopeName.House7LordInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @"An early marriage the partner may hail from an affluent and well-to-do family. The wife or husband will be mature and an advantage to the native. If the 7th lord is weak there may be no children. If severely afflicted one may get issues through the adulterous conduct of the wife. If there are both afflictions and benefic influences on the 7th lord the native may get only female progeny. Trouble to ones office superiors through foreign sources is likely. The native will possess good character.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House7LordInHouse5)),
            new(HoroscopeName.House7LordInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @"The native may have two marriages with both partners living. One may marry a cousin such as an uncles daughter. If badly afflicted and the karaka Venus is also ill-disposed one may suffer from impotency and many other diseases. The natives wife may be sickly and jealous by nature denying the husband happiness from marriage. If Venus is well placed but the 7th lord is afflicted the native may suffer from piles. If Venus is weak but not afflicted one may desert or lose ones married partner through some indiscreet act.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House7LordInHouse6)),
            new(HoroscopeName.House7LordInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @"If well placed the native will have a charming and magnetic personality. Women will flock to him and seek him out for alliance. The wife or husband will be a just and honourable person coming from a family of reputation and social standing. If weak and afflicted it gives a lonely life devoid of marriage and friends and loss through marriage negotiations.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House7LordInHouse7)),
            new(HoroscopeName.House7LordInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @"When well placed marriage may take place with relatives or the partner may be a rich person. Affliction causes the early death of partner while the native may die in distant lands. It gives a sickly and ill-tempered wife or husband leading to estrangement and separation.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House7LordInHouse8)),
            new(HoroscopeName.House7LordInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @"If fortified the father may live abroad while the native may make his fortune in foreign lands. He will get an accomplished wife who will enable him to lead a righteous life. If afflicted the father may die early. Married partner may drag the native from the right course Dharmic of life and he may waste away his wealth and suffer penury.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House7LordInHouse9)),
            new(HoroscopeName.House7LordInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @"The native may flourish in a profession abroad or his career may involve constant travelling One will get a devoted and faithful wife or husband. The wife may also be employed and contribute to the natives income. Or she may help in the advancement of the natives career. If afflicted wife will be avaricious and over-ambitious but without sufficient capacity. Consequently natives career may suffer and deteriorate.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House7LordInHouse10)),
            new(HoroscopeName.House7LordInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @"There may be more than one marriage or the native may associate with many women. If beneficially disposed wife may hail from a rich background or bring in much wealth. If afflicted the native may marry more than once but one wife may outlive him.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House7LordInHouse11)),
            new(HoroscopeName.House7LordInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @"There maybe more than one marriage in the natives life. He may marry a second time clandestinely while the first wife is still alive. Or if afflicted he may marry a second time after losing the first wife by death or separation. But if the affliction is severe the wife or husband may die or separate soon after marriage and there may be no second marriage. Death may occur while travelling or abroad. If both karaka and the 7th lord are weak the native may only dream of women but never marry. The natives wife may hail from a servants family. He will be close-fisted and generally poor.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House7LordInHouse12)),
            new(HoroscopeName.House8LordInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"Penury and heavy debts will befall the native who has the 8th lord placed in the Ascendant with the Ascendant lord. Misfortune will follow him at every step. If the 8th lord is weak or placed in the 6th 8th or 12th from Navamsa Lagna the intensity of misfortune is reduced. If the 8th lord is severely afflicted the native will suffer bodily complaints such as disease and disfiguration. His constitution will be weak and he will have no bodily comforts. He will be the target of the displeasure of his superiors and higher-ups. Trouble from Government will cause him worries.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House8LordInHouse1)),
            new(HoroscopeName.House8LordInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"The lord of the 8th house in conjunction with the 2nd lord in the 2nd house brings in troubles and problems of all sorts. The native suffers from eye and tooth troubles. He will have to eat unhealthy and tasteless or putrid foods. His domestic life will be filled with discontent and quarrels. His wife will not understand him. This may lead to estrangement and even separation. If longevity is good he may suffer some severe illness. If the 8th lord is in the 6th 8th or 12th from Navamsa Lagna the intensity of the results will be reduced in degree.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House8LordInHouse2)),
            new(HoroscopeName.House8LordInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"If the lord of the 8th house combines with the lord of the 3rd in the 3rd the third house significations suffer. The natives ears may cause problems or he may go deaf. Misunderstandings will crop up with brothers and sisters leading to quarrels. The native will be beset by all sorts of fears and mental anguish. He may imagine things and suffer from hallucinations. He may involve himself in debts and get into trouble thereby. If malefics afflict the 8th lord in the 3rd with the 3rd lord the sufferings of the native will be unbearable. But if the 8th iord combines with the 6th or 12th lords benefic results may come by. He may get a monetary windfall through writing or through the agency of a co born.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House8LordInHouse3)),
            new(HoroscopeName.House8LordInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @"If the iord of the 8th house joins the 4th lord in the 4th house the natives mental peace will be shattered Domestic bickerings financial and other problems will increase. Mothers health may suffer and cause great concern. The native may be beset with problems regarding his house land and conveyance. If the affliction is heavy his land and immovable property may slip from his hands due to circumstances beyond his control. His conveyances may get lost or be destroyed. His pets may contract diseases and die. Malefics furthering the affliction may force him to seek his fortune abroad where he will meet with all sons of troubles and losses. Reverses in profession and the displeasure of superiors are also likely.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House8LordInHouse4)),
            new(HoroscopeName.House8LordInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @" If the lord of the 8th is in the 5th with the 5th lord the children of the native may get into trouble. They may commit some crime and invite situations that could affect the natives reputation. Or the native and his father may develop misunderstandings. The natives child may fall sick and suffer thereby. If the affliction is heavy a child may die as soon as it is born or cause much grief to the native due to some incurable physical affliction or mental retardation. The native may also suffer much bodily ill-health. If the 8th lord is in the 6th 12th or 8th from Navamsa Lagna the evil results are greatly mitigated. But if fortified in a kendra quadrant or trikona trine the evil results are intensified. Since the 5th house is the buddhisthana the native may also suffer nervous debility or breakdown or mental aberration. When the 9th lord conjoins the 8th lord in the 5th house and the Lagna lord is debilitated the native has neither knowledge nor wealth  he is hostile lustful and ill-temprered. He tends to be crafty reviles God and pious men and is himself treated with contempt by his wife and children. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House8LordInHouse5)),
            new(HoroscopeName.House8LordInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @"If the lord of the 8th house joins the 6th lord in the 6th house a Rajayoga results. Material affluence fame and acquisition of objects desired are the good results. But because the 6th house is the house of disease the native may suffer ill-health. If afflicted the native suffers loss of money through theft and trouble through courts and the police. The evil is intensified if the 8th lord is in a kendra or trikona. The natives maternal uncle may suffer much trouble. If the 6th lord is fortified he is able to overcome all his troubles and emerge victor. No attempts made by his ill-wishers and enemies to harm him will succeed.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House8LordInHouse6)),
            new(HoroscopeName.House8LordInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @"The lord of the 8th house placed in the 7th house with the 7th lord curtails longevity. The natives wife may suffer ill-heaith. f afflicted the native will also suffer from disease. He may go abroad where he will meet with ill-health and problems. If the 7th and 8th lords are strong the native will undertake foreign journeys on diplomatic missions and distinguish himself.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House8LordInHouse7)),
            new(HoroscopeName.House8LordInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @"If the lord of the 8th house occupies the 8th house in strength the native lives long enjoying happiness. He will acquire lands conveyance power and position through the merit acquired in former lives. If the 8th lord is weak he may have no serious troubles but may not also enjoy any luck or good fortune of significance. The father of the native may die or pass through some crisis. If the 8th lord is afflicted the native will fail in his undertakings. He will be prompted to do the wrong things and thereby suffer loss.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House8LordInHouse8)),
            new(HoroscopeName.House8LordInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @"If the lord of the 8th house joins the 9th lord in the 9th house with malefics the native may lose his fathers property. Misunderstandings with father may arise. If the Sun the natural significator of father is afflicted father may die during the period of the 9th lord. If conjoined with benefics the native acquires his fathers property. Relations with father will be harmonious. If the 9th lord is weak the native suffers all kinds of hardships misery and unhappiness. His friends and kinsmen may desert him while his superiors will find fault with him. If the 8th lord is in the 6th 8th or 12th from Navamsa Lagna the evil results will be greatly reduced.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House8LordInHouse9)),
            new(HoroscopeName.House8LordInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @"If the lord of the 8th house is in the 10th house with the 10th lord the native has slow advancement in career. He faces obstacles and impediments in his activities. In the appropriate period he may be superseded by his subordinates and his merit may go unnoticed. He may resort to deceit and unrighteous means to gain his ends. His thinking will be clouded and his actions will invite the wrath of the government or the law. He may suffer poverty. If the 2nd lord is also afflicted and joins the 8th lord his reputation may suffer due to involvement in huge debts and inability to repay them. If the 8th lord is placed in the 6th 8th or 12th from Navamsa Lagna the intensity of the evil is greatly reduced. The 8th lord in the 10th may also confer unexpected gains due to the death of the superiors or elders.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House8LordInHouse10)),
            new(HoroscopeName.House8LordInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @"If the lord of the 8th house combines with the 11th lord in the 11 th house there may be trouble to close friends. Elder brother may pass through a difficult time. Relations with him will be strained and troubled. Or the elder brother may cause anguish to the native and his family by his unscrupulous behaviour and conduct. Business may suffer losses and run into debts. If benefic planets influence the combinations there will be troubles but the native gets help from friends and elder brother to overcome them. Afflictions will aggravate the malefic results.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House8LordInHouse11)),
            new(HoroscopeName.House8LordInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @"The position of the 8th lord in the 12th house with the 12th lord gives rise to a Rajayoga. If benefics join the 8th lord unfavourable results may be expected. Treachery of friends will result in many problems and grief. Unexpected expenditure will arise and there may be pecuniary losses. If the 8th lord is in the 12th house and the 12th lord is favourably placed in a trine or quadrant the native will gain in religious learning and piety. Some post or seat of authority may be thrust on him with all its attendant paraphernalia. If afflicted by malefics the native may resort to vicious acts clandestinely. Such acts would include rape adultery conterfeiting of money the 12th house is the house of secrecy end deceit. The 8th house signifies sudden gains of money and smuggling activities.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House8LordInHouse12)),
            new(HoroscopeName.House9LordInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"When the ninth lord is placed in the first house the native becomes a self-made man. He earns much money througn his own efforts. If the 9th lord combines with the Lagna lord in the first house and associates with or is aspected by a benefic planet the native is fortunate with riches and happiness.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House9LordInHouse1)),
            new(HoroscopeName.House9LordInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"When the ninth lord is placed in the 2nd house beneficially the natives father is a rich and influential man. The native acquires wealth from the father. Malefics influencing the ninth lord in the 2nd house ruin or destroy paternal property.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House9LordInHouse2)),
            new(HoroscopeName.House9LordInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"If the lord of the ninth is placed in the 3rd the native makes his fortune through writing speeches and oratorial abilities. The natives father will be a man of moderate means while the native advances his fortune through his co-borns. If malefics afflict the ninth lord in the 3rd house the native may land in trouble through his writings which may be irrational and even obscene depending upon the nature of affliction. He may be forced to sell his paternal property because of troubles occurring through his writings.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House9LordInHouse3)),
            new(HoroscopeName.House9LordInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @"The ninth lord in the 4th house gives vast landed properties and beautiful bungalows. Or the native may earn through estate and land dealings. His mother will be a rich and fortunate woman. He will inherit his fathers immovable properties. If the ninth lord is afflicted in the 4th house the native may not have any domestic unhappiness. His early life will be crossed by miseries due to a hard-hearted father or disharmony between parents. If Rahu afflicts mother may be a divorcee or living separately from his father.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House9LordInHouse4)),
            new(HoroscopeName.House9LordInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @"The ninth lord in the fifth house gives a prosperous and famous father. The natives sons may also be very fortunate in life and enjoy success and distinction.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House9LordInHouse5)),
            new(HoroscopeName.House9LordInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @"The ninth lord in the sixth house gives a sickly father afflicted with chronic diseases. If benefics flank such a sixth house the native may gain wealth through successful termination of fathers legal problems and by way of compensation costs etc. If malefics afflict the ninth lord in the sixth house the natives attempts to make his fortune may be frustrated through litigation involving his father or debts contracted by him.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House9LordInHouse6)),
            new(HoroscopeName.House9LordInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @"The native may go abroad and prosper there. His father may also prosper in foreign lands. He will get a noble and lucky wife. If ascetic yogas are present in the chart the native may seek spiritual guidance and fulfilment abroad. If asubhayogas spoil the ninth lord the father may meet with his death abroad.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House9LordInHouse7)),
            new(HoroscopeName.House9LordInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @"The native may lose his father early in life. If malefics afflict the eighth house in such a case he may suffer severe poverty and heavy responsibility due to fathers death If benefics influence the ninth lord the native may inherit substantial paternal property. Afflictions may cause the native to abandon traditions or damage religious institutions and trusts set up by the family.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House9LordInHouse8)),
            new(HoroscopeName.House9LordInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @"The ninth lord in the ninth house gives a long-lived and prosperous father. The native will be religiously inclined and be charitable. He will travel abroad and earn money and distinction thereby. If afflicted by malefics or if the 9th lord occupies the 6th 8th or 12th from Navamsa Lagna the natives father will die early.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House9LordInHouse9)),
            new(HoroscopeName.House9LordInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @"If the ninth lord is in the tenth house the native will become very famous and powerful. He will be generous and occupy posts of authority. He will earn much wealth and acquire every kind of comfort and luxury. His means of livelihood will be righteous and he will be a law abiding citizen.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House9LordInHouse10)),
            new(HoroscopeName.House9LordInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @"The native will be exceedingly rich. He will have powerful and influential friends. His father will be a well-known and well-placed man- If afflicted unfaithful friends will destroy the natives wealth through selfish scheming and fraud.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House9LordInHouse11)),
            new(HoroscopeName.House9LordInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @"The position of the lord of the ninth house in the twelfth house gives a poor background. The native will suffer much and will have to work very hard in life. Even then success may not come to him. He will be religious and noble but always in want. Father may die early leaving the native penniless.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House9LordInHouse12)),
            new(HoroscopeName.House10LordInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"When the lord of the tenth house occupies the Ascendant the native rises in life by sheer dint of perseverance. He will be self-employed or pursue a profession of independence. When the Lagna and 10th lord combine in the first house the native becomes very famous and a pioneer in his field of work. He founds a public institution and engages himself in social projects.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House10LordInHouse1)),
            new(HoroscopeName.House10LordInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"The 10th lord in the second house makes the native fortunate. He rises well in life and makes a lot of money. He may engage himself in the family trade and develop it. If malefics afflict the 10th house he will suffer losses and be responsible for winding up the family business. He will prosper in catering and restaurant businesses.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House10LordInHouse2)),
            new(HoroscopeName.House10LordInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"The native may have to travel constantly on short-journeys. He will be a speaker or writer of celebrity if the 10th lord is well-placed. His brothers may be instrumental to some extent in advancing his career. If 10th lord is in the 6th 8th or 12th from Navamsa Lagna or in an unfriendly constellation in the 3rd house the natives rise in life is slow and beset with obstacles. If the 3rd lord is also afflicted rivalry between brothers may Ie3d to reversals obstacles etc in the natives career.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House10LordInHouse3)),
            new(HoroscopeName.House10LordInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @"The native will be a lucky man and highly learned in various subjects. He will be famous both for his learning and generosity. If the 10th lord is strong the native is respected wherever he goes and he receives royal avour. He may engage in agricultural pursuits or in dealings with immovable properties- If the 4th lord the 9th lord and the 10th are beneficially disposed and related to one another the native wields great political authority as a president or head of a government. If the 10th lord is depressed eclipsed in an inimical sign or afflicted by malefic planets the native will lose his lands and be forced to take to a life of servitude. The same result obtains if the 10th lord conjoins the 8th lord in the 4th house in a malefic shashtyamsa.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House10LordInHouse4)),
            new(HoroscopeName.House10LordInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @"The native shines well as a broker and engages in speculation and similar business. If benefics join the lord of the 10th in the 5th house the native leads a simple and pious life engaging himself in prayers and pious activities. He may become the head of an orphanage or remand home if the 10th lord occupies the 6th 8th or 12th Navamsa.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House10LordInHouse5)),
            new(HoroscopeName.House10LordInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @"The person will have an occupation bearing on judiciary prisons or hospitals. If Saturn aspects the 10th lord he may have to work all his life in a low-paying jbb with not much prospects. If benefics aspect the 10th lord he holds a post of authority and will be held in high esteem for his character. If Rahu or afflicted malefics are with the 10th lord he may suffer disgrace in his career. He may be exposed to criminal action and face imprisonment.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House10LordInHouse6)),
            new(HoroscopeName.House10LordInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @"The 10th lord placed in the 7th house gives a mature wife who will assist the native in his work. He will travel abroad on diplomatic missions. He will be well known for his skill in talking and achieving objectives. He will make profits through partnerships and co-operative ventures. If malefics afflict the 10th lord the native will be debased in his sexual habits and indulge in every kind of vice.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House10LordInHouse7)),
            new(HoroscopeName.House10LordInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @"The native has many breaks in career. If the 10th lord is fortified he will occupy a high office in his field but only for a short time. If a malefic planet afflicts the 10th lord the person has criminal propensities and commits offences. If Jupiter influences the 10th lord by aspect or association in the 8th house he will become a mystic or spiritual teacher. Saturn here makes the person an undertaker or otherwise employed in burning ghats graveyards etc.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House10LordInHouse8)),
            new(HoroscopeName.House10LordInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @"The 10th lord in the 9th house makes the native a spiritual stalwart. He will be a beacon light to spiritual seekers if Jupiter aspects the 10th lord. If both benefics and maiefics aspect the 10th lord the native is generally fortunate and well-to-do. He follows a hereditary profession or that of a preacher teacher or healer. The father of the native has a great influence on him. He will be a dutiful son and do many charitable deeds.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House10LordInHouse9)),
            new(HoroscopeName.House10LordInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @"If the 10th lord is strongly disposed in the 10th the native can be highly successful in his profession and command respect and honour. If the lord is weak and afflicted he will have no self-respect cringing for favours. He will also be a dependent all his life. He will be fickle-minded. If the 10th lord occupies the 6th 8th or 12th houses from Navamsa the natives career will be routine and ordinary. If three other planets conjoin the 10th lord in the 10th house the native becomes an ascetic.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House10LordInHouse10)),
            new(HoroscopeName.House10LordInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @"The person earns immense riches. Fortunate in every respect he will engage himself in meritorious deeds. He will give employment to hundreds of persons and will be endowed with a high sense of honour. He will have many friends. If the eleventh house comes under affliction is friends will turn enemies and cause him every sort of hardship and worry.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House10LordInHouse11)),
            new(HoroscopeName.House10LordInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @"If the 10th lord occupies the twelfth house the native will have to work in a far-off place. He will lack comforts and face many difficulties in life. If beneficially disposed the native becomes a spiritual seeker. He will be separated from his family and wander about without success if malefics afflict the 10th lord. He will indulge in smuggling and other nefarious activities Rahu afflicting the 10th lord makes the native a cheat and a criminal. He causes sorrow to his family and relatives.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House10LordInHouse12)),
            new(HoroscopeName.House11LordInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"The native will be born in a rich family. He will earn much wealth. According as the 11th lord in Lagna is strong middling or weak the native will be born in a very rich fairly rich or well-to-do family. He will lose an elder brother early in life.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House11LordInHouse1)),
            new(HoroscopeName.House11LordInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"The native will live with his elder brothers. Benefics there give harmonious relations. Malefics cause domestic bickerings but common residence. The native will earn through commercial concerns and banking business. Business with friends will bring good profits but if malefics join the native may suffer heavy losses on account of friends.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House11LordInHouse2)),
            new(HoroscopeName.House11LordInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"The person will be a concert-singer or musician and will earn thereby. Gain through brothers is also indicated. He will have many friends and helpful neighbours-Afflictions give contrary results.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House11LordInHouse3)),
            new(HoroscopeName.House11LordInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @"One acquires profits through landed estates rentals and products of the earth. His mother will be a cultured and distinguished lady. He will be renowned for his learning and scholarship of various subjects. He will live in comfort and enjoy all joys in life. He will have a devoted and charming wife.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House11LordInHouse4)),
            new(HoroscopeName.House11LordInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @"The native will have many children who will come up well in life. He will indulge in speculation and gain much money. If the 11th lord is afflicted he will be a gambler and indulge in foolish ventures. If 11th lord is beneficially disposed the native will be pious and observe many resolves and vows which will enhance his prosperity.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House11LordInHouse5)),
            new(HoroscopeName.House11LordInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @"The person gains money through maternal relatives litigation and running nursing-homes. If the 11th lord is afflicted in the 6th the native thrives on setting person against person involve himself in other peoples quarrels and anti-social activity. If malefics afflict the 11 th lord the native may lose through similar sources.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House11LordInHouse6)),
            new(HoroscopeName.House11LordInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @"The person marries more than once. He prospers in foreign countries. If there are afflictions to the 11th lord the native carries on liaisons with women of ill-repute. He will indulge in trading in flesh and similar immoral activities. If the 11th lord is fortified the native marries only once but a rich and influential woman.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House11LordInHouse7)),
            new(HoroscopeName.House11LordInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @"The native though rich at birth suffers many calamities and loses much of his money. He will suffer from the depracies of thieves cheats and swindlers. If the 11th lord occupies a malefic constellation the native will be forced to eke out of his living by begging.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House11LordInHouse8)),
            new(HoroscopeName.House11LordInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @" He inherits a large paternal fortune and will be very lucky in life. He will possess many houses conveyances and every other kind of luxury. He will be religious-minded and disseminate religious literature. He will be charitable and set up charitable institutions. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House11LordInHouse9)),
            new(HoroscopeName.House11LordInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @" The native prospers very well in his business and makes good profits. His elder brother will also help him in his business. He will earn some prize-money for original contributions to the subject of his study or profession. Depending upon the benefic or malefic nature of the planet he will earn through fair or foul means. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House11LordInHouse10)),
            new(HoroscopeName.House11LordInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @"The native will have many friends and elder brothers who may help him throughout life. He will have a happy life with the blessings of wife home children and comforts.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House11LordInHouse11)),
            new(HoroscopeName.House11LordInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @"He will suffer losses in business. His eider brother will be ailing and much expenditure will be incurred on account of his illness. The native may also lose an elder brother by death. He will have to pay fines and penalties frequently and will be burdened with many domestic responsibilities.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House11LordInHouse12)),
            new(HoroscopeName.House12LordInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"The native will have a weak constitution and will be feeble-minded. He will however be handsome and sweet-tongued. If the sign is common the native will generally be travelling about. If the 6th lord joins the 12th lord in Lagna the native will live long. But if the 8th house is afflicted he will be short-lived. This also indicates imprisonment and living abroad. If the Lagna and 12th lords exchange signs the native will be a miser hated by all and devoid of intelligence.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House12LordInHouse1)),
            new(HoroscopeName.House12LordInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"The person will suffer financial losses. He may contact debts and get involved in nefarious activity. He will not eat timely meals. His eye-sight will be poor and his family life marked by lack of harmony. If the twelfth lord is a benefic and in dignity these evil indications will be greatly reduced and the native will have financial stability. He will be a tactful speaker. If the twelfth lord is ill-disposed the native indulges in gossip and quarrelling.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House12LordInHouse2)),
            new(HoroscopeName.House12LordInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"He will be timid and quiet. Loss of a brother is shown. He will be shabbily dressed. If malefics afflict he may develop ear-ailments. He may have to spend much money on younger brothers. As a writer he may be unsuccessful. He may work in some commonplace job and earn very little. If the 12th lord joins the 2nd lord in the 3rd and is aspected by Jupiter or the 9th lord one may have more than one wife.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House12LordInHouse3)),
            new(HoroscopeName.House12LordInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @"Early death to mother mental restlessness unnecessary worry enmity of relatives and living abroad are some of the results. Suffering constant harrassment from the landlord his residence will be in an ordinary house. But if the twelfth lord is well placed these adverse indications get mitigated to a large extent. If Venus is strong the native may own his own conveyance but it will always give trouble.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House12LordInHouse4)),
            new(HoroscopeName.House12LordInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @"Either difficulty to beget progeny or unhappiness from children will be experienced. He will be religious-minded and may undertake pilgrimages. Weak-minded and suffering mental aberrations he feels he is miserable. He will not succeed in agriculture as his crops will suffer from pests and disease.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House12LordInHouse5)),
            new(HoroscopeName.House12LordInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @"The native will be happy and prosperous live long enjoy many comforts possess a healthy and handsome physique and vanquish his enemies. But he may become involved in litigation which may come to an end to his advantage. But if melefics afflict the 12th lord the person will be unscrupulous sinful and ill-tempered hating his mother suffering from unhappiness on account of his own children. Womanising will land him in distress.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House12LordInHouse6)),
            new(HoroscopeName.House12LordInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @"The wife may come from a poor family. Married life will be unhappy and may end in separation. Later on he will take to asceticism. Weak in health and suffering from phlegmatic troubles he will be without learning or property.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House12LordInHouse7)),
            new(HoroscopeName.House12LordInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @"The native will be rich and celebrated will enjoy a luxurious life with many servants waiting on him. Gain through deaths and legacy is indicated. Interested in occult subjects and devoted to Lord Vishnu he will be righteous famous and a gentle speaker being endowed with many good qualities of head and heart.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House12LordInHouse8)),
            new(HoroscopeName.House12LordInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @"Residence abroad and prosperity are shown. He may acquire much property in foreign lands. Honest generous and large-hearted he may not have any spiritual leanings. Not liking his wife friends and preceptor and interested in physical culture he loses his father early in life.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House12LordInHouse9)),
            new(HoroscopeName.House12LordInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @"Hard-working and having to undertake tedious journeys for his occupation he will be a jailor doctor or work in the cemetery and such places. He spends money on agricultural pursuits in which he makes profits. The native will derive no happiness or physical comforls from his sons.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House12LordInHouse10)),
            new(HoroscopeName.House12LordInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @"He will engage himself in business but does not make much profit. He has few friends but many enemies. Troubled by extravagant brothers some of whom may be invalids the natives funds may dwindle on this account. He will earn well by trading in pearls rubies and other precious stones.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House12LordInHouse11)),
            new(HoroscopeName.House12LordInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @"The native spends much on religious and righteous purposes. He will have good eye-sight and enjoy pleasures of the couch. He will be engaged in agriculture. If malefics afflict the twelfth lord the native will be restless and always roaming about.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.House12LordInHouse12)),
            new(HoroscopeName.AriesRising, EventNature.Neutral, SpecializedSummary.Empty, @" Mental Tendencies.Independent thinking courageous and sensitive. Physical Tendencies.Middle stature ruddy complexion sharp sight long face and neck head broad at the temples and narrow at chin brown or light and curly mark or scar on the head or temples teeth well-set and round eyes. General Tendencies.Those born in Mesha are lovers of scientific thought. They are enterprising and ambitious. They have the ability to plan. They dislike being guided by others  are intense when interested vehement when excited. They are rather stubborn but often frank. Quick tempered they resent imposition and are liable to go to extremes. Their constitution will be hot. They love beauty art and elegance. They have practical ideas. If Aries is afflicted they suffer from diseases pertaining to the head. Mental affliction and derangement are also likely if Saturn and the Moon are in Aries. ", [EventTag.Personal,EventTag.RisingSign,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.AriesRising)),
            new(HoroscopeName.TaurusRising, EventNature.Neutral, SpecializedSummary.Empty, @" Mental Tendencies.Obstinate proud and ambitious  easily accessible to adulation but affectionate and loving sometimes unreasonable prejudiced and stubborn. Physical Tendencies.The stature of the person born in this sign will be short and often tending towards corpulence lips thick and complexion swarthy square build of the body. Face beautiful eyes and ears large full forehead hands plump and broad. General Tendencies.If they are not listened to attentively people born in this sign will act like a bull. They are self-reliant They have their own principles and ways and a piercing intellect. They have a great deal of endurance latent power and energy. They always put their ideas into practice. Their physical powers and mental endurance are indeed noteworthy. They are fond of pleasure they love beauty and music. They possess a magnetic personality. They think they are born for exercising authority. They generally suffer from nervous complaints after the fiftieth year. With regard to children much happiness is not indicated. The late Prof. B. Suryanarain Rao was a typical example of Taurus ascending. ", [EventTag.Personal,EventTag.RisingSign,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.TaurusRising)),
            new(HoroscopeName.GeminiRising, EventNature.Neutral, SpecializedSummary.Empty, @" Mental Tendencies.- They will have a wavering mind. Fond of writing and reading they are ingenious and quickwitted vivacious and inconsistent nervous and restless. Physical Tendencies.They are tall and straight in stature and active in motion. Face well developed there is a depression near the chin a thin face sanguine complexion unusual height if malefics are there the eyes are clear and the nose snub. They are weak but active. General TendenciesThey are very active and tend to become experts in mechanical sciences. They may suffer sudden nervous breakdowns. They must be cautious in moving with the opposite sex. Their mind will be often conscious of their own depravity. They are very clever and possess inherent conversational and literary ability. They are liable to fraud and deception. If evil planets are in Gemini trickery and deceit will characterize their nature. They are best in occupations where there is much activity. ", [EventTag.Personal,EventTag.RisingSign,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.GeminiRising)),
            new(HoroscopeName.CancerRising, EventNature.Neutral, SpecializedSummary.Empty, @" Mental Tendencies-People born in this sign will be extremely sensitive inquisitive nervous and restless interested in music and dexterous. Physical Tendencies.They have a middle sized body face full slightly snub nose fair complexion long arms long face and wide chest. General Tendencies.They are very intelligent bright and extremely frugal and equally industrious. Their frugality often takes the form of miserliness. The mind is intuitional perceptive. They like pleasure. They are deeply attached to their family and children. They often meet with disappointment in love affairs. They are very talkative self-reliant honest and unbending. They will have a reputation for love of justice and fairplay. Their emotions are strong. They have psychic tendencies are receptive to new ideas and adapt themselves to environment. They are desirous of possessions and cautious. They can best take up occupations of a fluctuating nature. ", [EventTag.Personal,EventTag.RisingSign,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.CancerRising)),
            new(HoroscopeName.LeoRising, EventNature.Neutral, SpecializedSummary.Empty, @" Mental Tendencies.People born in Leo are ambitious as well as avaricious warm-hearted and have a liking for art literature and music. They are cheerful and unimpul-sive. Physical Tendencies.Persons born in this sign will be magnetic in appearance with broad shoulders bilious constitution of average height oval faced thoughtful countenance and the upper part of the body is generally better formed. General Tendencies.They can adapt themselves to any condition in life. They have faith. In affection they are sincere. They stick to orthodox principles in religion but are perfectly tolerant. Generally good tempered they are sensitive. They are lovers of music literature and possess a certain amount of philosophical knowledge. They are voracious readers. In life they do not succeed as much as they would like to and often throughout they struggle very much. Their ambitions remain unfulfilled to a great extent. They lack a natural policy and hence get into many difficulties. They are forgiving and do not hold a grudge long. They are likely to suffer from nervous troubles and are generally misunderstood by their superiors and bosses. ", [EventTag.Personal,EventTag.RisingSign,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.LeoRising)),
            new(HoroscopeName.VirgoRising, EventNature.Neutral, SpecializedSummary.Empty, @" Mental Tendencies.Those born in Virgo are impulsive emotional and fond of learning. They love music and fine arts. They lack self-confidence. Methodical and ingenious they have active minds. Physical Tendencies.Persons born in this sign will be middle-sized. Their chest will be prominent and when afflicted weak also. They have a straight nose cheeks massive and the forehead good. General Tendencies.They exhibit their intelligence when quite young. They are discriminating and emotional and get easily carried away by impulse. They are cautious regarding their own interests prudent economical diplomatic and shrewd. As authors they make progress in physical and chemical sciences. They acquire much power and influence over others. They are liable to suffer from nervous breakdowns and paralysis when the sign is afflicted. They are of a speculative nature. ", [EventTag.Personal,EventTag.RisingSign,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VirgoRising)),
            new(HoroscopeName.LibraRising, EventNature.Neutral, SpecializedSummary.Empty, @" Mental Tendencies.Persons born in Libra are idealistic quick-witted vindictive forceful and positive. Physical Tendencies.They generally possess fair complexion a middle-sized stature phlegmatic constitution handsome appearance broad face fine eyes broad chest and regular features. Their appearance will be generally youthful. General Tendencies.People Vrn in this sign are generally of a sensual disposition. They are keen observers of human nature. They have keen foresight and reason out things from the standpoint of their own views. They love justice peace order and are agreeable persons. They are ambitious. They are more idealists than realists or practical men and often contemplate on schemes that are like building castles in the air. They are not sensitive to what others say of them. As political leaders and religious reformers they exert tremendous influence over the masses and sometimes their zeal and enthusiasm can go to such a pitch that they can force their views upon unwilling minds. They are not easily amenable to reason. They are great lovers of music. Truth and honesty have a special appeal for them. ", [EventTag.Personal,EventTag.RisingSign,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.LibraRising)),
            new(HoroscopeName.ScorpioRising, EventNature.Neutral, SpecializedSummary.Empty, @" Mental Tendencies.Sarcastic and impulsive a ferhale born in this sign will be masculine in nature. Interested in occult forms of study they possess a subtle mind hard to influence. Physical Tendencies.Persons born in this sign are handsome in appearance. The bones are well developed. They have broad eyes tall figure curly hair and broad forehead. The personality is forceful with prominent brows and preceptive faculties. General Tendencies.They will have a generous disposition. They are exceedingly fickle-minded and love much excitement. Though inclined to sensual things in reality they will not hesitate to philosophise upon the virtues of controlling sensual pleasures. They are good correspondents. They are often brutal brusque and keenly fond of contest. They possess enterprise. They appreciate luxury but are frugal. They may become expert musicians if they learn that art. They can also become proficient in fine arts dancing and the like. They uphold their own views. Their constitution will be hot and they are liable to suffer from piles. They are good conversationalists as well as writers and often rely too much on their own intelligence. ", [EventTag.Personal,EventTag.RisingSign,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.ScorpioRising)),
            new(HoroscopeName.SagittariusRising, EventNature.Neutral, SpecializedSummary.Empty, @" Mental Tendencies.Those born in Sagittarius have an inclination for philosophy and occult studies. They can acquire great mastery in these subjects. Humane and somewhat impulsive they are generally active and enterprising. Physical Tendencies.Persons born in this sign are generally inclined towards corpulence. They possess almond eyes and their hair is brown. They are usually good looking. Evenly set teeth a happy smile and fullness of the figure characterise the natives of Dhanus. General Tendencies.They are of a phlegmatic temperament. They are too conventional and also business-like. They are prompt and uphold conservative views. They are sympathetic and loving and possess good foresight. At times they are restless and overanxious. They are too callous and enthusiastic. They hate all external show. They are God-fearing honest humble and free from hypocrisy. They exercise strict control over their food and drinks and in regard to their relations with the opposite sex. They are prone to be misunderstood unintentionally by others. In late years they must be careful about their lungs as they are liable to suffer from rheumatic pains and the like. ", [EventTag.Personal,EventTag.RisingSign,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SagittariusRising)),
            new(HoroscopeName.CapricornRising, EventNature.Neutral, SpecializedSummary.Empty, @" Mental Tendencies.They are stoical to the miseries of life. Possessed of sympathy generosity and philanthropy self-willed strong in purpose secretive and vindictive Capricorn natives are cunning and determined. Physical Tendencies.Persons born in this sign are tall lean reddish-brown in colour with prominent stiff hair on the eye-brows and the chest. The head is big and the face fairly broad. They have large teeth a big mouth prominent nose and are inclined to stoop. The body is thin and fleshy. General Tendencies.They have a knack to adapt themselves to circumstances. They have great aspirations in life and cannot economise funds. They like a lot of show. Noted for their perseverance. They become vindictive when Saturn is afflicted and may become somewhat bigoted. They are capable of much endeavour. In the home life they are perfectionists and often cannot get on well with husbands or wives. They should check this harmful tendency on their part. They are industrious. If Mars occupies any sign other than his own they lack confidence become funky nervous and weak-minded. They can be described as chatter-boxes and have little or no control over their tongues. ", [EventTag.Personal,EventTag.RisingSign,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.CapricornRising)),
            new(HoroscopeName.AquariusRising, EventNature.Neutral, SpecializedSummary.Empty, @" Mental Tendencies.Aquarius being a philosophica sign people born in it become great teachers writers and lecturers provided the sign is free from afflictions. Natives of Aquarius are reserved they are peevish when provoked generous hearted highly sympathetic and are always bent upon helping others. They are intelligent good memory and capable of dealing with facts. Physical Tendencies.They are generally tall and lean with countenance handsome appearance attractive and disposition elegant. Their lips are flushy cheeks are broad and they have prominent temples and buttocks. If Saturn is in the 4th the chest will be weak with a tendency towards stooping. General Tendencies.They make friends of others very soon. They are peevish and when provoked rise like a bulldog but their anger is easily subsided. They shine very well as authors and writers. Their conversation is always interesting. They are sometimes timid and funky. They feel shy to exhibit their talents before new audiences. They specialise in subjects like astrology and become great upholders of some such cause. Their literary greatness comes before the world when they are quite young. Unless the planetary positions are otherwise favourably situated people born in this sign will suffer certain critical setbacks which will jeopardise their reputation. Owing to their humanitarian doctrines they are prone to be misunderstood. In family life they will not have sufficient happiness. They will be much devoted to their husbands or wives. They are liable to suffer from colic troubles chest pain and the like. They should always be kept happy in life by their husbands or wives. Otherwise their health will suffer. ", [EventTag.Personal,EventTag.RisingSign,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.AquariusRising)),
            new(HoroscopeName.PiscesRising, EventNature.Neutral, SpecializedSummary.Empty, @" Mental Tendencies.Persons born in Pisces are stubborn psychically receptive highly religious stoical bigotted and God-fearing. Physical Tendencies.They are fair stout of middle-sized height swarthy in complexion eyes piscean and inclined towards corpulence. General Tendencies.They are respectors of ortho-doxical principles and can forego anything but orthodoxy. They are extremely superstitious. They are very reserved and are liable to draw premature conclusions on any matter. They are God-fearing and very rigid in the observance of religious customs and practices. They are stubborn rather timid and ambitious to exercise authority over others. They rarely realise their ambitions. They are restless and fond of history antiquarian talks and mythological masterpieces. They are frugal in spending money and though generally dependent upon others throughout their life still bear a mark of independence. They are just in their dealings and fear to transgress the laws of truth. With all this they lack self-confidence. ", [EventTag.Personal,EventTag.RisingSign,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.PiscesRising)),
            new(HoroscopeName.SunInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"Strong moral nature righteous-minded ambition and love of power tends to be well supported by good health and vitality. Cheerfulness and an optimistic temperament help to ensure popularity. It adds respect to the personality and gives lofty motives. If with Saturn or Mars it indicates scars and a hot constitution. The blood becomes impure and there will be itches all over the body. Fevers inflammations and eye affections may also be anticipated.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInHouse1)),
            new(HoroscopeName.MoonInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"The native becomes fanciful and romantic a moderate eater. Considerable restlessness is usually tempered by an easy-going disposition. The fortune is generally changing. It makes one an idealist a great traveller and explorer. If with Saturn the mind will always be worried. IfMarsiswith the Moon it indicates menstrual disorders in the case of women. Sociability tends to be a strong feature. He will be successful in professions that bring him into contact with the masses. The Moon in Lagna with Rahu indicates hysterical tendencies and with Jupiter the mind is elevated.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonInHouse1)),
            new(HoroscopeName.MarsInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"This gives a hot constitution courage self-confidence and enterprise. The native will possess practical ability and love of liberty and independence. He becomes reckless of danger scorning defeat. This gives somewhat of a rash nature. The body will have scars and the appearance will be handsome. The domestic life will be unhappy unless there are other favourable combinations. Abuse of physical resources may lead to ill-health. There is a proneness to accidents. The aspects should be carefully examined. Danger of cuts burns etc. are likely.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsInHouse1)),
            new(HoroscopeName.MercuryInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"This position makes the subject humorous. Quickness of wit and mental ingenuity tend to be strongly marked. The native becomes well-read particularly in occult studies. In good aspect to Venus it makes one musical and talented. Adaptability is a striking feature. Mercury makes the man intellectual. If there is a Rahu or Ketu in Lagna the native suffers a lot of nervous troubles.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryInHouse1)),
            new(HoroscopeName.JupiterInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"A magnetic personality is bestowed on the native. An optimistic spirit jovial disposition and pleasant manners are indicated. The native will have more sons if the 5th house is not affected. Self-indulgence especially in regard to gluttony will affect health. If with Rahu sms will be committed. Body will be inclined towards corpulence. Lawyers professors writers theologians etc. come under this planet. The man becomes an influential leader. Diseases may result from impure blood.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.JupiterInHouse1)),
            new(HoroscopeName.VenusInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"This is a fortunate combination more so if the ascendant happens to be Capricorn or Aquarius. The native will possess amiability and a cheerful temperament responsive to the emotional side of nature. It gives an appreciation of art. There will be craving for pleasure. Passions will be pronounced. The native will take interest in music drama and singing. There will be a fondness for scents flowers etc. Those born in this sign will be admired by the opposite sex. Generally a good fortune is denoted. Fond of wife or husband the native will have a magnetic and attractive personality. Marriage may take place early. If afflicted it indicates discord in married life.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VenusInHouse1)),
            new(HoroscopeName.SaturnInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"Foreign customs will be easily copied and imitated. But if Saturn is not afflicted there will be much consideration for the welfare or others.Self-confidence is normally justified. Moral stability will also be marked. The disposition is calm grave and serious. The body will be weak and emaciated. Progress in any venture will be slow but certain. There may be some aversion for responsibility. This position of Saturn makes habits inactive. Loss through negligence and lack of opportunity are possible. The same results will be noticed if the ascendant is aspected by Saturn. Misfortunes are likely in the early part of life.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnInHouse1)),
            new(HoroscopeName.RahuInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"The health will be generally unsatisfactory calling for treatment other than by medical methods. It inclines one to the occult and the serious wilfulness of nature is well marked. A hypocritical super-consciousness towards others is likely. It makes one appear rather odd and eccentric. This combination is usually bad for marriage. Rahu will generally partake of the characteristics of Saturn.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.RahuInHouse1)),
            new(HoroscopeName.KetuInHouse1, EventNature.Neutral, SpecializedSummary.Empty, @"Psychic powers are likely. It denotes a weak constitution and an emaciated figure. Instability and deceitfulness may influence the character. Morbid imagination strange appetites tendency to excitability and wandering disposition become pronouncedly marked. Married life will be unhappy unless there are other favourable configurations.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.KetuInHouse1)),
            new(HoroscopeName.SunInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"This is not quite a favourable situation. Losses will occur by offending the authorities. He will have a diseased face. He will obtain money by industrious effort. The nature of the income depends on the nature of the sign. He will be stubborn and peevish", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInHouse2)),
            new(HoroscopeName.MoonInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"He will have a large family and will enjoy much happiness. Money will also be obtained through females. The financial position will be somewhat variable will have a fair complexion. Dhundiraja a noted astrological writer of yore says that when the Moon is in the 2nd house the native will be reserved and not much sociable squint eyed and much admired.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonInHouse2)),
            new(HoroscopeName.MarsInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"Becomes quarrelsome. Good earning powers but usually miserly. Much money is accumulated. A good conversationalist. He will befriend evil-minded persons be unsympathetic and pick up quarrels with all.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsInHouse2)),
            new(HoroscopeName.MercuryInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"Learned in religious and philosophical lore. Denotes gain by lecturing business and commercial affairs. Becomes rich. Highly intelligent. He spends money on charities and moral purposes. Clever in earning money and careful and thrifty.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryInHouse2)),
            new(HoroscopeName.JupiterInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"Becomes a poet a great writer astrologer or even a scientist. Increases the chances for success. He accumulates fortune good wife and family surroundings. He will not quarrel with others. Money will be acquired through things indicated by the signs ruled by Jupiter.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.JupiterInHouse2)),
            new(HoroscopeName.VenusInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"Large family. Money usually comes readily by favours from others. Eats good food possesses conveyances. Handsome appearance skilful and pleasant will marry a good wife or husband. Health and wealth are indicated in a large measure.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VenusInHouse2)),
            new(HoroscopeName.SaturnInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"Saturn unless the second is Libra Capricorn or Aquarius tends to make earning an uphill struggle. Much work with little gain. Harsh speech unsocial sorrowful and roaming about aimlessly the person comes across many opportunities but seldom takes advantage of them. In family life he will be unhappy. He will gain by dealing with metals storage mines labour etc. He will be unpopular.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnInHouse2)),
            new(HoroscopeName.RahuInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"Peevish diseased face friction in family life danger to eye-sight. Financial affairs uncertain unless other favourable combinations occur. If Jupiter aspects the second house then earnings will be good. Money is gained through friends and business.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.RahuInHouse2)),
            new(HoroscopeName.KetuInHouse2, EventNature.Neutral, SpecializedSummary.Empty, @"Bad speaker. Loss through fraud and deception. There will be liability in financial affairs. Success in spiritualism navigation mystical arts hospital etc. may be expected.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.KetuInHouse2)),
            new(HoroscopeName.SunInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"Makes the person courageous. The mind becomes resourceful and restive successful. Bad for brothers if afflicted. Discredit through letters. Position of the Sun in the 3rd is one of the strong points in a horoscope.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInHouse3)),
            new(HoroscopeName.MoonInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"Generally changes in occupation are indicated fond of travelling and active minded. Wife will be fair. The subject possesses.good knowledge. Rather indifferent to spiritual values of life. Subordinate to wife. Attached to children. If however the Moon is waning cruel miserable impious and unscrupulous. An unfavourable position for peace of mind if afflicted.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonInHouse3)),
            new(HoroscopeName.MarsInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"This position is bad for brothers and sisters. Liability to danger and accidents by journeys. Brave Worried on account of family misunderstandings. Reckless pioneering and unprincipled. May be troubled with ear defects or even deafness. If the house is further afflicted it shows thoughts of suicide or violent tendencies.If the third is Capricorn Aries or Scorpio the evil effects will be largely modified.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsInHouse3)),
            new(HoroscopeName.MercuryInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"Will do good deeds for the benefit of others but he will not himself be happy. The mind is sharp. Fond of reading and study  when once he undertakes a work he does it to the finish and will never get discouraged. Tactful and diplomatic. He will befriend businessmen and merchants. He will generally be successful in trade and speculation. A number of brothers and sisters. Independent views. Liked by friends and relatives. When Mercury is afflicted the native is inclined to nervous break-down. Gain through third house affairs.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryInHouse3)),
            new(HoroscopeName.JupiterInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"This is also a good position. The mind is optimistic and philosophical. Will have many good brothers. Becomes a miser. Does not love family and children. The body gets heated and he suffers from ill-health. He may be devoid of gratitude if Jupiter is afflicted. He does not have many friends. Does not take advantage of opportunities. Adapts himself to conventionalities.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.JupiterInHouse3)),
            new(HoroscopeName.VenusInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"The mental quality is good but health will be poor lacking in vitality. He will take delight in singing music dancing and fine arts. Financially he will not be very successful. If Venus is afflicted miserly mean poor and highly sensual. He becomes funky and interested in scandals. Brothers will be good. Not much happiness from children.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VenusInHouse3)),
            new(HoroscopeName.SaturnInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"Brave and courageous wealthy loss of brothers eccentric and cruel. Sorrow through brothers  honoured by rulers  may become head or president of local boards municipalities etc. He will protect many people. One peculiarity of this combination is that success attends him only after he has suffered disappointments and reverses. The tendency of the mind is towards gloom anxiety and misgivings. The mental condition improves with age. If Saturn is afflicted the despondency is likely to run into mental affliction.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnInHouse3)),
            new(HoroscopeName.RahuInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"Brave for outward appearances. Sudden and unexpected news. The combination is generally bad for brothers. He may incur severe criticism on account of his views and ideas.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.RahuInHouse3)),
            new(HoroscopeName.KetuInHouse3, EventNature.Neutral, SpecializedSummary.Empty, @"Strong and adventurous but funky. Disturbs the mind with hallucinations.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.KetuInHouse3)),
            new(HoroscopeName.SunInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @" This combination is said to make one generally unhappy and mentally worried. He will be roaming about. The position promises some inheritance. He will have interest in occult and philosophical studies. In the political Geld success is difficult. Obstacles in life are shown if Saturn or Mars aspects the Sun. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInHouse4)),
            new(HoroscopeName.MoonInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @" Possesses house derives happiness from relatives will he cheerful and contented becomes important as a leader or ruler  proud and somewhat quarrelsome. The position indicates early separation from the mother if the Moon is afflicted will be fond of sensual pleasures unless aspected by Jupiter. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonInHouse4)),
            new(HoroscopeName.MarsInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @" This is generally a bad combination. The person will be deprived of happiness from mother relations and friends but will have success in the political line. There will be quarrels with mother and domestic affairs go awry. If Mars joins Rahu or Ketu the man will have a tendency for suicide. The person will own houses but will not be happy on that account. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsInHouse4)),
            new(HoroscopeName.MercuryInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @" Shines well as an educationist or diplomat. He will boldly criticise the Government. He will be held in great esteem. Father will be a self-made man. He will command a good conveyance. He will have taste for music and other fine arts and will frequently travel to far off countries. He will be witty in speech. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryInHouse4)),
            new(HoroscopeName.JupiterInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @" Philosophically inclined learned happy possesses the favour of the ruling class a terror to his enemies religiously inclined respected and fortunate peaceful domestic environments great spiritual advancement. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.JupiterInHouse4)),
            new(HoroscopeName.VenusInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @" Well versed in music polished manners deep attachment to mother many friends conveyances and houses religious by inclined successful achievement of desires. This is a favourable yoga for affairs of a domestic nature concord and happiness. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VenusInHouse4)),
            new(HoroscopeName.SaturnInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @" Sickly during early years deprived of mother and unhappy suffers from windy and phlegmatic complaints lethargic temperament will not inherit any property will have troubles from houses and vehicles disliked by relatives desire to live a very secluded life unfavourable for domestic or family affairs unless beneficially aspected or associated. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnInHouse4)),
            new(HoroscopeName.RahuInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @" Foolish in behaviour few friends will be subjected to fraud or guilty of fraudulent action. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.RahuInHouse4)),
            new(HoroscopeName.KetuInHouse4, EventNature.Neutral, SpecializedSummary.Empty, @" Will be deprived of mother properties and happiness lives in a foreign place. There will be exceptional experiences at the end of life. There will be reversals and sudden changes. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.KetuInHouse4)),
            new(HoroscopeName.SunInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @" This combination deprises the person of children riches and happiness. His life will be short. He will suffer from heart disease will roam about in forest regions a mountaineer. This position also denotes difficult child-birth. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInHouse5)),
            new(HoroscopeName.MoonInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @" Clarity of mind happiness from children acquisition of lands gems and precious stones opportunity to serve the State are indicated when the Moon is in the 5th. The person will be straightforward truthful learned gentlemanly god-fearing and devoid of enemies. Strong tendency towards speculation is also denoted. One of the children becomes famous. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonInHouse5)),
            new(HoroscopeName.MarsInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @" Miserable for his wife friends and children  always disturbed in thoughts impressive rash weak- minded back-biter and unhappy. He will suffer from colic and suffers misfortunes through children. Too much attached to sex pleasures and consequently loss of health. Dangerous child-birth may be predicted in a womans chart. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsInHouse5)),
            new(HoroscopeName.MercuryInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @" Learned and happy will have a number of children. The person may become an adviser or a minister  highly intelligent and learned in Mantrasastras  inclined to too much of sex pleasure and consequently lacking in vitality. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryInHouse5)),
            new(HoroscopeName.JupiterInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @" Learned in logic and law mantrasastra highly intelligent preceptor or adviser to a king and great discriminating power. He will have good friends and vehicles and decorous manners. A number of children  god-fearing  happy with children and friends. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.JupiterInHouse5)),
            new(HoroscopeName.VenusInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @" Poetic possesses a number of friends and beautiful children  happiness through offspring  wise and discriminating acquires wealth  respected by the State. This position also indicates more of female children and success in speculation. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VenusInHouse5)),
            new(HoroscopeName.SaturnInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @" Evil-minded and stupid  sickly and weak poor and hated by others. This combination denotes sorrows through children. Fortune will be variable and not steady and he will have a hyprocritical nature. Quarrels with friends and relatives and sorrow in domestic life. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnInHouse5)),
            new(HoroscopeName.RahuInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @" Suffers from colic mistaken by others and unfriended will lose a number of children hard-hearted and unconventional heart trouble. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.RahuInHouse5)),
            new(HoroscopeName.KetuInHouse5, EventNature.Neutral, SpecializedSummary.Empty, @" Loss of children trouble in the stomach strange and peculiar experiences in connection with emotions and feelings. Later on in life inclination towards spirituality. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.KetuInHouse5)),
            new(HoroscopeName.SunInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @" The Sun.The person becomes a good politician famous and successful. Not very good for health. Sun afflicted  Long and troublesome illness. Sun fortified  Good administrative ability few enemies wealthy and generally successful in all endeavours. Affliction by Saturn is not desirable as it indicates heart-trouble or frequent chest pain unless the affliction is relieved by Jupiters aspect. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInHouse6)),
            new(HoroscopeName.MoonInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @" The Moon.Indicates Balarishta or much ill-health during early childhood. Affliction by Mars and Saturn  curious and incurable diseases and revengeful enemies. Moon strongly denotes ability and success in subordinate positions. If the sixth is a fixed sign the person will suffer from stone in the bladder he will be submissive to women  weak sexual connection and stomach troubles. Afflicted in common signs danger from lung troubles. He will have success as a caterer. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonInHouse6)),
            new(HoroscopeName.MarsInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @" Mars  Highly passionate victorious and successful as a ruler or politician. He will have worries from near relatives. Mars afflicted  accidents losses and troubles through employees. If Saturn is the afflicting planet death may be due to operation or injury by animals. If Rahu afflicts Mars death may be due to suicide. If Ketu he will die by poisoning ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsInHouse6)),
            new(HoroscopeName.MercuryInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @" Mercury.Quarrelsome and showy but yet respected  interrupted education. If afflicted mental troubles and danger of nervous breakdown. If afflicted by Mars and Rahu or Saturn and Rahu there is danger of insanity through excitement troubles with servants and a tendency to poor health. The person will be lazy harsh in speech but nevertheless a terror to his enemies. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryInHouse6)),
            new(HoroscopeName.JupiterInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @" Jupiter.Inactive suffers disrespect indulges in black magic feared by enemies unlucky dyspeptic health generally good. If afflicted health suffers through overindulgence. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.JupiterInHouse6)),
            new(HoroscopeName.VenusInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @" Venus.No enemies corrupted by young women favourable for getting favours from women. If afflicted  health affected by too much sexual indulgence fond of other women and licentious. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VenusInHouse6)),
            new(HoroscopeName.SaturnInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @" Saturn.Quarrelsome obstinate voracious eater foeless courageous. If afflicted sickness through privation or neglect troubles through subordinates. If Mars is the afflicting planet dangerous illness and operations. If Rahu afflicts the person suffers from hysteria. Saturn wellaspected denotes gains through contract work mining masonry etc. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnInHouse6)),
            new(HoroscopeName.RahuInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @" Rahu.Long-lived and wealthy troubled by enemies ghosts and diseases in private parts. He will also suffer from sickness of a puzzling nature. There is also liability to mental derangement if the Moon and Saturn join Rahu. The person will have many cousins and his private life will be scandalous. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.RahuInHouse6)),
            new(HoroscopeName.KetuInHouse6, EventNature.Neutral, SpecializedSummary.Empty, @" Ketu.The best position for Ketu to occupy in a horoscope. The person will have fame and authority. He will be foeless. Nevertheless his moral character will be loose. The position also confers intuitive and occult powers. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.KetuInHouse6)),
            new(HoroscopeName.SunInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @" The Sun-.The native will be fair and have thining hair. He will have few friends and finds difficulty in getting along with people. Marriage is delayed and troubled. Fond of travelling he will have loose morals. He likes foreign things. His wifes character will be questionable and the native will run the risk of loss and disgrace through women. He will incur the displeasure of the Government and suffer humiliation. He will be deformed. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInHouse7)),
            new(HoroscopeName.MoonInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @" The MoonThe native will be passionate and easily roused to jealousy. Mother may die while the native is young. Wife will be good-looking but the native will seek other women. Narrowminded but sociable he will be energetic and successful in life. He hails from a good family if the Moon is waxing and otherwise strong. He will suffer pain in the groins. He will be stingy. If the Moon is waning he will always be quarrelling with his enemies. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonInHouse7)),
            new(HoroscopeName.MarsInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @" Mars The native will be hen-pecked by his wife and submissive to women. Married life will have clashes and tensions or there may be two wives. The native will be rash and indulge in speculation. He will be intelligent tactless stubborn peevish and unsuccessful. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsInHouse7)),
            new(HoroscopeName.MercuryInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @" Mercury A man of virtue and geniality he will dress well and tastefully. He will have profound knowledge of law. He will be skilled in business and trade tactics. He will have writing ability and success through it early in life. Early marriage to a rich woman. Learned in mathematics astrology and astronomy he will be religious and of a devout temperament. Diplomatic but if afflicted the native will be cunning and deceitful. He will have a good physique and looks. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryInHouse7)),
            new(HoroscopeName.JupiterInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @" JupiterDiplomatic and kind-hearted the native gets a virtuous good-looking and chaste wife. He will get good education and gains through marriage. He will be sensitive to others feelings. He has a speculative mind and is a good agriculturist. He undertakes pilgrimages to distant places and is superior to father in his qualities. The native will possess good sons. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.JupiterInHouse7)),
            new(HoroscopeName.VenusInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @" Venus  Fond of quarrelling sensuous and passionate the native has unhealthy habits and a happy marriage and devoted wife. He is fond of pleasure and drink is suave and charming with winning manners. He has a magnetic personality. He has danger of loss of virility due to disease or excesses. He is successful in partnership with those of the opposite sex. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VenusInHouse7)),
            new(HoroscopeName.SaturnInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @" Saturn  The native will be under the wifes control. The wife will be ugly or hunch-backed. He will have more than one marriage or marriage with a widow divorcee or one advanced in age. He will be diplomatic and enterprising. He has residence abroad a stable marriage and political success. He will get honour and distinction in foreign lands suffers from colic pains and deafness. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnInHouse7)),
            new(HoroscopeName.RahuInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @" Rahu The native brings ill-repute to family if a female. He will be unconventional and heterodox. He will have affairs with outcaste women or foreigners. His wife suffers from womb disorders. He eats good and rich food has luxurious habits and suffers from diabetes ghosts and the supernatural. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.RahuInHouse7)),
            new(HoroscopeName.KetuInHouse7, EventNature.Neutral, SpecializedSummary.Empty, @" Ketu The native has an unhappy marriage with a shrewish wife. He is passionate sinful lusts after widows. His wife is sickly. The native suffers from cancer in the abdomen or uterus if a female. He will suffer humiliation and loss of virility. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.KetuInHouse7)),
            new(HoroscopeName.SunInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @" The Sun If the Sun occupies the 8th house in exaltation the native lives long. He will be charming and an eloquent speaker. If the Sun is afflicted he will be troubled with sores in the face and head and be disgruntled in life. His eyes will be weak. He will suffer penury and an uneventful life. If associated with the 8th or 11th lord he may gain monetary benefits all of a sudden through speculation. He will have limited progeny mostly male. If the Sun is in the 8th the Moon or Rahu is in the 12th and Saturn is in a trine the native suffers from dental problems. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInHouse8)),
            new(HoroscopeName.MoonInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @" The Moon The native with the Moon in the 8th is subject to mental aberration. He is apprehensive and suffers from psychological complexes. He will be capricious and unhealthy. The native may lose his mother in infancy or boyhood. His built will be slender and eyesight will be weak. He acquires possessions easily through legacies or inheritance. He will be fond of fighting and amusement and be large-hearted. The native suffers from excessive perspiration if Mars and Saturn conjoin and the Moon is in the 8th house the natives eyesight will be afflicted. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonInHouse8)),
            new(HoroscopeName.MarsInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @" Mars  The native will be short-lived unless there are other alleviating factors and he may suffer the loss of wife or husband. He will have very few children. He may seek to gratify his passions by resorting to extra-marital life. He will hate his relatives. His domestic life will be marred by quarrels and he suffers from bloodly complaints like piles. He will rule over many people. If Mars is in the 8th the Lagna is a fixed sign Venus is in the 9th the Moon is in the 7th and Jupiter is the 2nd lord the native will be condemned to lead a life of servitude. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsInHouse8)),
            new(HoroscopeName.MercuryInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @" Mercury.  When Mercury is in the 8th the native will possess many good qualities. He will be known for his breeding and courteous disposition. He will inherit as well as earn much wealth. He will be learned and famous for his scholarship in many subjects. He will live long but have a weak constitution. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryInHouse8)),
            new(HoroscopeName.JupiterInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @" Jupiter The native will be unhappy but generous hearted. He will live long. He will have difficulty in speech. He may do ignoble deeds but pretend to be noble. He may have liaisons with widows. He will have dirty habits and suffer from colitis. He will have a painless death. If Jupiter is debilitated and the Moon is in the 4th house from Lagna the native will be a menial being always ordered about. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.JupiterInHouse8)),
            new(HoroscopeName.VenusInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @" Venus-The position of Venus in the 8th gives many blessings. The native will come by much wealth. He will live a life of comfort and possess all the conveniences for such life. The natives mother may suffer danger. The native himself may meet with emotional disappointments early in life. As a consequence he may resort to a life of piety in later life. If exalted in the 8th the native gains much wealth. If Venus in the 8th is debilitated in Rasi or occupies a saturnine Navamsa and is aspected by Saturn the native suffers subordination and leads a life of drudgery along with his mother. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VenusInHouse8)),
            new(HoroscopeName.SaturnInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @" Saturn Saturn in the 8th house gives good longevity but many responsibilities in life. The native will discharge his duties through sheer perseverance against odds which will be many. He will have defective eyes. He will have very few children. He will have a paunch and be inclined to seek the company of women outside his caste. He may be predisposed to suffer from asthma consumption and lung disorders. If afflicted by malefic planets his children will cause him pain and grief. The native will be dishonest and cruel. When Saturn is in the 8th with Mars Rahu is in Lagna and Gulika occupies a trine the native suffers disease in his generative organs. If the Moon joins Saturn in the 8th the result is flatulence and spleen troubles. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnInHouse8)),
            new(HoroscopeName.RahuInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @" Rahu The native will suffer from public censure and humiliation. He will be troubled by many ailments. He will be vicious quarrelsome and unscrupulous. If the Moon conjoins with a malefic planet and Rahu is in the 8th 12th or 5th house the native will suffer from mental disorders. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.RahuInHouse8)),
            new(HoroscopeName.KetuInHouse8, EventNature.Neutral, SpecializedSummary.Empty, @" Ketu   If Ketu in the 8th is aspected by a benefic the native will enjoy much wealth and live long. If Ketu is afflicted the native covets others wealth and women. He will suffer from diseases due to disorders in the excretory system and also those due to a life of profligacy and excesses. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.KetuInHouse8)),
            new(HoroscopeName.SunInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @" The Sun  The native may change his faith if the Sun is afflicted. He displays hostile feelings towards his father lacking respect for elders and spiritual preceptors. But if the Son is not afflicted the person will be a dutiful son having regard for spiritual pursuits. The Moon combining with the Sun here causes eye troubles Venus with the Sun gives sickness and ailments. The health will be ordinary and the native gets little patrimony. He will be ambitious and enterprising. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInHouse9)),
            new(HoroscopeName.MoonInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @" The Moon The native will be fortunate and prosperous. He will have many sons friends and kinsmen. He will be principled and generous-minded. If Saturn Mars and Mercury aspect the Moon the native will become a ruler. If the Moon combines with Mars he may cause a fatal injury to his mother. If Venus conjoins the Moon in the 9th the person may lead an immoral life. He will act in league with his step-mother. Saturn here causes one to suffer much. The native may build charitable institutions. He will acquire good immovable property and also visit foreign countries. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonInHouse9)),
            new(HoroscopeName.MarsInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @" Mars  The native will wield authority and be affluent. He will have children and be happy. He will not be a dutiful son but otherwise generous and famous for his good qualities if either Jupiter or Mercury conjoin Mars the native will be learned in religion and spiritual lore. Venus here gives two wives and foreign residence it also gives the native proficiency in law. Saturn with Mars in the 9th indicates addiction to other women and a wicked nature. He will be self-seeking stubborn and impetuous. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsInHouse9)),
            new(HoroscopeName.MercuryInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @" Mercury  The native will acquire much education and wealth. He will be a great scholar. He will be interested in theosophy and metaphysics. He will have a scientific mind and fond of music and pleasure if Venus joins Mercury. Jupiter with Mercury in the 9th confers wit and wisdom. He may travel abroad on invitations and be invited to lecture in educational institutions. Relations with father will be friendly and happy. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryInHouse9)),
            new(HoroscopeName.JupiterInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @" Jupiter The native may become an exponent of law philosophy etc. if Jupiter is aspected by benefic planets he acquires much immovable property. He will be fond of his brothers if the Moon and Mars influence Jupiter he will become a great military leader or commander if the Sun and Venus join Jupiter the native becomes characterless. Jupiter beneficially aspected by Saturn makes the native live a life of austerity and strive for divine communion. He may visit foreign lands as a lecturer preacher etc. He will be conservative and principled. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.JupiterInHouse9)),
            new(HoroscopeName.VenusInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @" Venus  The native is born fortunate and endowed with fame learning children wife and generally every kind of happiness. The Sun with Venus makes one sauve and polished in speech but one may suffer from many physical complaints. Venus with Saturn makes the person a diplomat or otherwise engaged in similar work under a king or government. He will be well known for his balanced views on men and matters. Venus with the Sun and Moon may involve the person in quarrels with women resulting in loss of money. The Sun and Saturn with Venus give criminal tendencies and other combinations warranting the person may face conviction. He can also be notorious as a libertine. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VenusInHouse9)),
            new(HoroscopeName.SaturnInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @" Saturn  The native will lead a lonely life and may not marry. He will be well known for his valour on the battle field. The Sun with Saturn causes serious conflicts with the father and also with his own children. He may suffer from growths or lumps in the stomach. Mercury with Saturn makes the native untruthful and deceitful although he may be wealthy. Thrifty in domestic life somewhat irreligious he may become a founder of charitable institutions. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnInHouse9)),
            new(HoroscopeName.RahuInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @" Rahu  The native will have a nagging and domineering wife. He will be impolite and miserly suffering from emaciation and generally inclined to be of loose morals. He will hate his father and revile God and religion. But he may become famous and acquire much wealth. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.RahuInHouse9)),
            new(HoroscopeName.KetuInHouse9, EventNature.Neutral, SpecializedSummary.Empty, @" Ketu  The native will be short-tempered and may get upset over trifles. He will be eloquent but employ this ability to scandalize others. Fond of pomp and show haughty and arrogant he will however be valorous. Often treating his parents badly and generally hostile towards them he will be short-sighted but save much money through frugal living. He will have a good wife and children. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.KetuInHouse9)),
            new(HoroscopeName.SunInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @" The Sun  The native is successful in all that he undertakes. He will be strong and happy. He will have sons vehicles fame intelligence money and power. He will be employed in government service. He will acquire ancestral wealth. He will be fond of music and have personal magnetism. If Mars associates with the Sun the native becomes addicted to vices like drinking etc. If Mercury joins the Sun he acquires profound knowledge of the sciences. He will be fond of women and ornaments. If Venus joins the Sun in the 10th house the native gets a rich wife. Saturn with the Sun generally causes sorrow and dejection. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInHouse10)),
            new(HoroscopeName.MoonInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @" The Moon  The native will be religious wealthy intelligent and bold. He will succeed in all his endeavors. He will obtain corn ornaments women and will be skilled in the arts. He will be of a helpful nature and virtuous. Jupiter with the Moon makes the native learned in ancient subjects and skilled in astrology. If Saturn aspects the Moon the native will be a dispassionate thinker but earning through printing and selling books. He will have many friends and lead a comfortable and long life. He will be the trustee of religious institutions. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonInHouse10)),
            new(HoroscopeName.MarsInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @" Mars  Other combinations favouring the native may become a cruel ruler. He will be fond of praise and may take bold steps in governing. He will be rash. He will earn much money. If Mercury joins Mars the person will be a skilled scientist or technician patronised by the rulers. If Jupiter is with Mars the native becomes the head of low-class people. If with Venus he becomes a trader in foreign lands. If Saturn and Mars combine in the 10th house he will be daring but will have no progeny. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsInHouse10)),
            new(HoroscopeName.MercuryInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @" Mercury He will be a happy and straightforward person. He will be a scholar in many subjects and engaged in acquiring more knowledge and fame. He will be successful in all his endeavours. He will have defective eyesight but profound knowledge in astronomy and mathematics. If Venus joins him the native will have a charming wife and wealth. If Jupiter he will be unhappy and childless but move in prominent circles of the government. Saturn and Mercury make the native toil in jobs like that of a copyist or proofreader and suffer penury. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryInHouse10)),
            new(HoroscopeName.JupiterInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @" Jupiter  The native will be a high official in the government. Rich virtuous steadfast in his spiritual or religious life wise and happy he will be guided by high principles. If Jupiter and Venus combine in the 10th house the person is held in esteem by the government and entrusted with the protection Of the Brahmins learned people. If he is with Rahu he becomes a mischief-maker and will create trouble for others at every step. If Jupiter is aspected by Mars the native heads research institutes academics and educational institutions. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.JupiterInHouse10)),
            new(HoroscopeName.VenusInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @" Venus  The native earns through houses and buildings. He will be highly influential and has many women working for him. He will be social friendly and renowned. If Venus combines with Saturn the native will profit from cosmetics and articles used by women. He will have healing powers and will be a skilled trader. His education will be disrupted. He will have respect for divine people. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VenusInHouse10)),
            new(HoroscopeName.SaturnInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @" Saturn  The native becomes a ruler or minister. He will be an agriculturist brave rich and famous. He will be dispassionate in nature and will work for the downtrodden masses. He will be judicious and work in the capacity of a judge. The native visits sacred rivers and shrines and in later life becomes an ascetic. His career will be marked by sudden elevations and depressions. If Saturn is associated with the 8th lord in a malefic Navamsa the native suffers under a tyrannical superior officer. If the 10th lord joins Saturn together with the lord of the Navamsa occupied by the 10th lord and is influenced by aspect or conjunction with the 6th lord the native will have more than one wife. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnInHouse10)),
            new(HoroscopeName.RahuInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @" Rahu  There is a tendency to lusts after widows. He will be a skilled artist with a flair for poetry and literature. He travels widely and is learned. He will be famous and will engage himself in business. He will have limited issues. Bold and somewhat adventurous he commits many sins. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.RahuInHouse10)),
            new(HoroscopeName.KetuInHouse10, EventNature.Neutral, SpecializedSummary.Empty, @" Ketu  The native will be strong bold and well-known. He will commit vile deeds and be impure in his resolves. He will face many obstacles in all his undertakings. He will be very clever. If beneficially disposed the native will be happyreligious well read in the scriptures and visit many pilgrim centers and sacred rivers. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.KetuInHouse10)),
            new(HoroscopeName.SunInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @" The Sun The person lives for a long time and becomes wealthy. He will have wife children and many servants. He gets royal and governmental favours and achieves success without much effort. He will be sagacious and principled. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInHouse11)),
            new(HoroscopeName.MoonInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @" The Moon One will be noble generous and blessed with riches wife and children. Introspective by nature and quiet-going he will become famous making good profits in business. He will acquire vast lands and be helped in his endeavours by the fair sex. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonInHouse11)),
            new(HoroscopeName.MarsInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @" Mars - The native will be an eloquent and forceful speaker clever and rich but lustful will acquire landed Properties and wield considerable influence in top circles. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsInHouse11)),
            new(HoroscopeName.MercuryInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @" MercuryOne becomes learned in many sciences. He will possess a keen and sharp intellect will be wealthy truthful and happy will have many faithful servants and will prosper in engineering ventures. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryInHouse11)),
            new(HoroscopeName.JupiterInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @" JupiterThe native will be long-lived. He will have a limited number of issues will be bold and wealthy with a piercing intellect and will become renowned. He will be fond of music will accumulate riches and will have many friends. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.JupiterInHouse11)),
            new(HoroscopeName.VenusInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @" Venus  He will be of a wandering nature will make immense profits possessing all kinds of comforts and luxuries. He will have a weakness for women and long for their company. He will be popular having many friends. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VenusInHouse11)),
            new(HoroscopeName.SaturnInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @" Saturn The native earns through employing many men and women. He will have few friends will be fond of enjoyment and will earn through Government sources. He will have a long and healthy life and will be involved in politics commanding great respect. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnInHouse11)),
            new(HoroscopeName.RahuInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @" Rahu -The native distinguishes himself in the army or navy will become famous wealthy and learned  will have few children will suffer from ear afflictions and will earn much wealth in foreign countries. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.RahuInHouse11)),
            new(HoroscopeName.KetuInHouse11, EventNature.Neutral, SpecializedSummary.Empty, @" Ketu The native will have the habit of hoarding. He may get monetary wind-fall through speculation such as lottery horse-racing and the stock exchange. Noble and possessed of many good qualities of head and heart he will succeed in all his ventures and will participate in charitable and similar works of beneficence. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.KetuInHouse11)),
            new(HoroscopeName.SunInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @" The Sun The native may take to an immoral life and engage himself in vile occupations. He will not be quite successful in his life and may feel neglected by all. He will suffer the loss of some limb and have weak eye-sight. He will however be energetic and have sons. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInHouse12)),
            new(HoroscopeName.MoonInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @" The Moon  The native may suffer from some deformity. He will be narrow-minded hard-hearted and mischievous. He prefers to lead on obscure life in solitude. Eye-sight will be weak. If the Moon is waning and combines with Saturn sloth and lethargy will be the result. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonInHouse12)),
            new(HoroscopeName.MarsInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @" Mars  The person may lose his wife. He will be selfish hateful and suffer diseases due to excess of heat in the body. He is liable to deception and may lose his money. If Mars and Saturn occupy the 12th and the 2nd houses respectively the Moon be in Lagna and the Sun in the 7th house he may suffer from leucoderma. If Mars in the 12th house is aspected by the Sun danger from fire and wicked people is indicated. Malefics in the 7th and the 8th and Mars in the 12th denote that one will have another wife even when the first is alive. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsInHouse12)),
            new(HoroscopeName.MercuryInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @" Mercury Capricious and wayward the person will indulge in extra-marital relations and suffer penury and perverted thinking will make him unhappy. He will also have a few children. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryInHouse12)),
            new(HoroscopeName.JupiterInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @" Jupiter The native may deride religion and be evil-minded. He will commit fearful deeds and lead a lascivious life. Later on he repents and reforms himself. The native will always be anxious about his vehicles ornaments and clothes. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.JupiterInHouse12)),
            new(HoroscopeName.VenusInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @" Venus  Desertion by relatives  hankering after comforts without success and penury will make the natives life miserable. He will indulge in lying and associates with low women. His eye-sight will be poor. If Venus is exalted contrary results will happen. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.VenusInHouse12)),
            new(HoroscopeName.SaturnInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @" Saturn  The native will be dull-headed and lose all his money. He will have squint eyes and a deformed limb make many enemies suffer losses in trade be a pessimist and commits sins in secret. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnInHouse12)),
            new(HoroscopeName.RahuInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @" Rahu  The native will be prosperous immoral but of a helpful nature. He will have eye troubles. If the Sun is in the 7th Mars is in the 10th and Rahu is in the 12th Bhava the natives father will die early. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.RahuInHouse12)),
            new(HoroscopeName.KetuInHouse12, EventNature.Neutral, SpecializedSummary.Empty, @" Ketu  The native will have a restless and wandering mind and leave his country of birth. The lower classes will befriend him. All his inherited property may be lost. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.KetuInHouse12)),
            new(HoroscopeName.GeminiRisingWithEvilPlanet, EventNature.Bad, SpecializedSummary.Empty, @" Evil planets are in Gemini trickery and deceit will characterize their nature. ", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.GeminiRisingWithEvilPlanet)),
            new(HoroscopeName.AriesRisingWithEvilPlanet, EventNature.Bad, SpecializedSummary.Empty, @"Mental affliction and derangement are also likely since Saturn and the Moon are in Aries.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.AriesRisingWithEvilPlanet)),
            new(HoroscopeName.Lord2WithEvilInHouse, EventNature.Bad, SpecializedSummary.Empty, @"If the second lord is in the 2nd with evil planets or aspected by him he will be poor.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.Lord2WithEvilInHouse)),
            new(HoroscopeName.SaturnIn2WithVenus, EventNature.Neutral, SpecializedSummary.Empty, @"Ordinary wealth is indicated if Saturn is in the 2nd aspected by Venus.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnIn2WithVenus)),
            new(HoroscopeName.MoonMarsIn2WithSaturnAspect, EventNature.Bad, SpecializedSummary.Empty, @"If the Moon and Mars reside in the 2nd bhava and Saturn aspects it he suffers from a peculiar skin disease.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonMarsIn2WithSaturnAspect)),
            new(HoroscopeName.MercuryAndEvilIn2WithMoonAspect, EventNature.Bad, SpecializedSummary.Empty, @"The situation of Mercury in the 2nd with another evil planet aspected by the Moon is bad for saving money. Even if there is any ancestral wealth it will be spentrather wasted on extravagant purposes.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryAndEvilIn2WithMoonAspect)),
            new(HoroscopeName.SunIn2WithNoSaturnAspect, EventNature.Good, SpecializedSummary.Empty, @"The Sun in the 2nd without being aspected by Saturn is favorable for a steady fortune.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunIn2WithNoSaturnAspect)),
            new(HoroscopeName.MoonIn2WithMercuryAspect, EventNature.Good, SpecializedSummary.Empty, @"The Moon being placed in the 2nd and aspected by Mercury is favorable for earning money by self-exertion.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MoonIn2WithMercuryAspect)),
            new(HoroscopeName.Lord2And3In6WithEvilPlanet, EventNature.Bad, SpecializedSummary.Empty, @"He will be poor if lords of the 2nd and 3rd are in the 6th with or aspected by evil planets.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.Lord2And3In6WithEvilPlanet)),
