            new(HoroscopeName.MaleficIn11FromArudha, EventNature.Bad, SpecializedSummary.Empty, @"Unjust means of earning because malefic planets in the 11th from Arudha Lagna.", [EventTag.Personal,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MaleficIn11FromArudha)),
