            new(HoroscopeName.MarsVenusIn7th, EventNature.Good, SpecializedSummary.Empty, @" When Mars and Venus are in the 7th the boy or girl concerned will have strong sex instincts and such an individual should be mated to one who has similar instincts ", [EventTag.Marriage,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsVenusIn7th)),
            new(HoroscopeName.MercuryOrJupiterIn7th, EventNature.Good, SpecializedSummary.Empty, @" Mercury or Jupiter in the 7th makes one under-sexed. And such an individual should not be mated to a person with strong sex instincts. ", [EventTag.Marriage,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MercuryOrJupiterIn7th)),
            new(HoroscopeName.LeoLagna7thLordSaturnIn2, EventNature.Bad, SpecializedSummary.Empty, @" When Leo is Lagna and the 7th lord Saturn is in the 2nd the husband will be subservient to the wife carrying out all her orders. ", [EventTag.Marriage,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.LeoLagna7thLordSaturnIn2)),
            new(HoroscopeName.SaturnIn7thNotLagnaLord, EventNature.Bad, SpecializedSummary.Empty, @" Saturn in the 7th house is also indicative of unhappiness in marriage unless Saturn happens to be either lord of Lagna or lord of the 7th. exception accounted for ", [EventTag.Marriage,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SaturnIn7thNotLagnaLord)),
            new(HoroscopeName.MarsIn7thNoBenefics, EventNature.Bad, SpecializedSummary.Empty, @" If Kuja is in the 7th house unaspected or not joined by benefics there will be frequent quarrels in the married life often leading to misunderstandings and separation. ", [EventTag.Marriage,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.MarsIn7thNoBenefics)),
            new(HoroscopeName.SunVenusIn5th7th9th, EventNature.Bad, SpecializedSummary.Empty, @" If the Sun and Venus occupy the 5th 7th or 9th house then the native will lack marital happiness. ", [EventTag.Marriage,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunVenusIn5th7th9th)),
            new(HoroscopeName.Lord7And1Friends, EventNature.Good, SpecializedSummary.Empty, @" Lords of the 7th and 1st are friends then the native will be loved by his wife. ", [EventTag.Marriage,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.Lord7And1Friends)),
            new(HoroscopeName.Lord7And1NotFriends, EventNature.Bad, SpecializedSummary.Empty, @" Lords of the 7th and 1st are enemies or bitter enemies. There will be no harmony in marriage. ", [EventTag.Marriage,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.Lord7And1NotFriends)),
