            new(HoroscopeName.SunInAries, EventNature.Good, SpecializedSummary.Empty, @" Sun in Aries - Active intelligent famous traveler. wealthy warrior. variable fortune ambitious phlegmatic powerful marked personality impulsive irritable pioneering initiative. ", [EventTag.Horoscope,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInAries)),
