            new(HoroscopeName.SunInLeo, EventNature.Good, SpecializedSummary.Empty, @" Leo - Stubborn fixed views strong cruel independent organizing capacity and talents for propaganda humanitarian frequenting solitary places generous famous. ", [EventTag.Horoscope,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInLeo)),
            new(HoroscopeName.SunInVirgo, EventNature.Good, SpecializedSummary.Empty, @" Virgo - Linguist poet mathematician taste for literature well scholarly artistic good memory reasoning faculty effeminate body frank lucid comprehension learned in religious lore reserved wanting adulation. ", [EventTag.Horoscope,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInVirgo)),
