            new(HoroscopeName.SunInScorpio, EventNature.Good, SpecializedSummary.Empty, @" Scorpio - Adventurous bold rearing thieves and robbers reckless cruel stubborn unprincipled impulsive idiotic indolent surgical skill dexterous military ability. ", [EventTag.Horoscope,], EventManager.GetHoroscopeCalculatorMethod(HoroscopeName.SunInScorpio)),
